VALUES (34, 34, 10, 210, 'rock-cut', 'Intrusive images', 'Intrusive images', 'On the left wall of the upper level verandah, there are many intrusive images, including various small seated Buddhas (one with a contemporary inscribed Buddhist creed) and bodhisattvas, a large standing female bodhisattva with a bunch of flowers, and a six-armed seated goddess.', 'c10/_CAV3508.jpg', '', '', 1, 0, NULL, 197, 132, 0.41041667, 0.42580645, 'Arno Klein', 0, FALSE, NULL, FALSE)
