INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (35, 36, 10, 210, 'rock-cut', 'Bodhisattva Maitreya', 'Maitreya', 'Smaller but equally complex lateral arches, slightly varied in design, and supported by cushion-capitaled demi-pillars with dramatically projecting brackets, enclose niches with bodhisattvas attended by their associated goddesses. This bodhisattva (the flying dwarfs unfinished) may be identified as Maitreya, given the stupa in the crown. This niche has loving couples above.', 'c10/_CAV3509.jpg', '', '', 1, 0, NULL, 204, 97, 0.42500000, 0.31290323, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
