VALUES (37, 37, 10, 210, 'rock-cut', 'Bodhisattvas Prajnaparamita and Avalokitesvara', 'Prajnaparamita and Avalokitesvara', 'The large panels on the wall between the central and side arches were probably not part of the original conception of this cave, but are probably roughly contemporary intrusions, for they break the disciplined design scheme of the facade. A female and male bodhisattva, probably Prajnaparamita (with her book) and Avalokitesvara (with his lotus) appear at the left.', 'c10/_CAV3513.jpg', '', '', 1, 0, NULL, 226, 113, 0.47083333, 0.36451613, 'Arno Klein', 0, FALSE, NULL, FALSE)
