INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (39, 40, 10, 210, 'rock-cut', 'Buddha and Bodhisattvas', 'Buddha and Bodhisattvas', 'The large panels on the wall between the central and side arches were probably not part of the original conception of this cave, but are probably roughly contemporary intrusions, for they break the disciplined design scheme of the facade. At the right, we find a notable representation of a crowned Buddha, probably the first in these western caves, and possibly even anticipating related forms in eastern India where, during Pala times, it became increasingly popular.  The image, seated in dhyanasana on a three-lion throne (seen here), and displaying the teaching gesture, is flanked by a seated Avalokitesvara with his lotus on the left, and a seated Manjusri, with his tiger-claw necklace and characteristic headdress on the right. Just below, another Manjusri, with the same flower, appears, next to a Buddha on a lotus throne, curiously supported by nagas, since his hand is in the bhumisparsa mudra - a gesture connected with the earth rather than the waters. All three of the bodhisattvas just mentioned show varada mudra, the gesture of offering.', 'c10/_CAV3515.jpg', '', '', 1, 0, NULL, 311, 114, 0.64791667, 0.36774194, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
