VALUES (41, 41, 10, 210, 'rock-cut', 'Bodhisattva Avalokitesvara', 'Avalokitesvara', 'Smaller but equally complex lateral arches, slightly varied in design, and supported by cushion-capitaled demi-pillars with dramatically projecting brackets, enclose niches with bodhisattvas attended by their associated goddesses.  Avalokitesvara with the Buddha Amitabha in his jata headdress, holding an expanded lotus, and with antelope skin, appears in the right niche (seen here). Above the image is a delightful crowd of playful dwarfs.', 'c10/_CAV3517.jpg', '', '', 1, 0, NULL, 335, 101, 0.69791667, 0.32580645, 'Arno Klein', 0, FALSE, NULL, FALSE)
