VALUES (143, 55, 10, 210, 'rock-cut', 'couple figures and ribbed vault', 'small gallery detail', 'A small gallery underneath the central arch inside the cave overlooks the spacious interior. It can be reached by a stairway coming up from the left side of the porch below below from outside the main cave. The gallery has beautiful frieze that centers upon a splendid dancing female. The panels at either side show single female figures in a delightful array of poses and activities, alternating with loving couples.', 'c10/_CAV3537.jpg', '', '', 1, 0, NULL, 232, 82, 0.48333333, 0.26451613, 'Arno Klein', 0, FALSE, NULL, FALSE)
