VALUES (195, 195, 11, 11, 'rock-cut', 'Seated Buddha - First Floor', 'Buddha', 'At the center of the first floor''s front aisle an assertively projecting Buddha in a shallow shrine is seated in the pose of meditation. His lion throne, a scalloped throne cloth over its base, has the conventional throneback motifs above: elephants, vyalas, and makaras, the latter spouting scrolling foliage. He is flanked by the bodhisattvas Avalokitesvara (with lotus and Buddha in jata headdress), and a crowned Vajrapani. The latter holds a curiously warped vajra in his hand; some problem in the rock must have been responsible for this. Flying couples - crowded by the bodhisattvas'' haloes--converge upon the image from above.', 'c11/_CAV3332.jpg', '2/2006', '', 1, 0, NULL, 264, 79, 0.55000000, 0.18202765, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
