VALUES (220, 220, 11, 211, '', '', '', 'The large seated Buddha, his hand in bhumisparsa mudra, sits upon a throne which, like that in the right wing, is supported by crouching dwarfs.  Again, the earth goddess lifts an overflowing pot, while to the right Aparajita triumphs over the Hindu god Ganesa. Again, projecting elephants appear at the base of the throne back. Quite surprisingly, the expected makaras appear both above the elephants and (conventionally) above the rearing vyalas, with their riders. The Buddha sits against a huge bolster, while flying couples converge from above.', 'c11/_CAV3357.jpg', '', '', 1, 0, NULL, 146, 85, 0.30416667, 0.28333333, 'Arno Klein', 0, FALSE, NULL, FALSE)
