VALUES (226, 226, 11, 211, '', '', '', 'As in the right shrine, similarly massive figures of Avalokitesvara and Vajrapani attend the seated Buddha, while similar figures of seated Buddhas (at the upper level) and bodhisattvas (below) fill the lateral wall spaces.  The disposition of the latters attributes is slightly different on the left, where the second figure, instead of the first, holds the sword.', 'c11/_CAV3363.jpg', '', '', 1, 0, NULL, 111, 105, 0.23125000, 0.35000000, 'Arno Klein', 0, FALSE, NULL, FALSE)
