INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (265, 265, 11, 211, '', '', '', 'The right shrine of the second floor has a huge Buddha seated against a large bolster. He gestures in the bhumisparsa mudra, while the earth goddess presents a purnaghata from below, near the left yaksha squatting with raised arms, supports the throne. Buddhas halo is backed by a carved tree which probably extended overhead; the raised area above must have been painted with the leaves.\r\n\r\nThe projecting elephants at the base of the throneback are magnificently huge (about 5 feet) while the vyalas just above are also somewhat unusual, with their dwarf riders. Similarly the makaras are untypical, with their emergent lions, the expected scrolls being relegated to the space just over their heads. Large flying couples converge from above, on either side, as is by now conventional.\r\n', 'c11/_CAV3402.jpg', '', '', 1, 0, NULL, 357, 92, 0.74375000, 0.30666667, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
