VALUES (283, 283, 11, 211, '', '', '', 'The huge Avalokitesvara figure at the left of the seated Buddha holds a huge expanded lotus, and has a towering jata headdress and huge cauri. The projecting form over his proper left shoulder may have been the beginning of an antelope skin, completed in plaster. The equally impressive Vajrapani at the right holds a vajra on a long stemmed utpala, his lowered hand resting on a massive coil of garment. The proper right hand holds the chauri.\r\n\r\nSix seated Buddhasthree on each side occupy the upper level of the left and right walls, their gestures alternating between dharmacakra and dhyana mudras. Beneath, lifesize bodhisattvas stand on double lotus pedestals, holding their various attributes, some now broken away.', 'c11/_CAV3420.jpg', '', '', 1, 0, NULL, 384, 90, 0.80000000, 0.30000000, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
