VALUES (306, 306, 11, 211, '', '', '', 'The deep two-pillared shrine area at the center of the central shrine floor is lit by two windows. Buddha seated on the lion throne, with his proper right hand "touching the earth" (bhumisparsa mudra). Bodhisattvas Avalokitesvara, with a lotus and Amitabha in his headdress, and Vajrapani, with a crown and vajra, stand at left and right. Single celestials with garlands converge upon the image from above. The throneback has the conventional elephant-vyala-makara combination. The same "earth-touching" Buddha is figured in similar shrines both to left and right.', 'c11/_CAV3443.jpg', '', '', 1, 0, NULL, 229, 143, 0.47708333, 0.47666667, 'Arno Klein', 0, FALSE, NULL, FALSE)
