VALUES (379, 379, 12, 212, 'rock-cut', 'Rakta-Avalokitesvara, Tara and Bhrikuti, Second floor', '', 'Various lesser carved panels are scattered throughout this floor, with a notable number of female bodhisattvas among them, while in a few instances relief stupas replace or substitute for Buddha images. A particularly impressive example, visible to the left of the center aisle (seen here), shows the seated bodhisattva Rakta-Avalokitesvara, with Amitabha Buddha in his jata headdress and an expanded lotus, seated between Tara (with varada mudra) on the left, and Bhrikuti (with her water pot) on the right.', 'c12/_CAV3045.jpg', '2/2006', '', 1, 0, NULL, 179, 258, 0.37291667, 0.54088050, 'Arno Klein', 0, FALSE, NULL, FALSE)
