VALUES (380, 380, 12, 212, 'rock-cut', 'Bodhisattva, Second floor', '', 'Located in the right of the center aisle is this bodhisattva flanked by four females, all seated in lalitasana, with varadamudra, and raised flowers.', 'c12/_CAV3046.jpg', '2/2006', '', 1, 0, NULL, 268, 255, 0.55833333, 0.53459119, 'Arno Klein', 0, FALSE, NULL, FALSE)
