VALUES (384, 384, 12, 312, 'rock-cut', 'Monk cell - First floor', '', 'Residence cells surround the hall, two even occupying available locations in the shrine antechamber area.  The three cells on the left wall of the main hall, and one at the right rear have simple stone beds (supplied with a stone pillow), all but one cut on each cell''s darkest wall.', 'c12/_CAV3050.jpg', '2/2006', '', 1, 0, NULL, NULL, NULL, NULL, NULL, 'Arno Klein', 0, FALSE, NULL, FALSE)
