VALUES (386, 386, 12, 212, 'rock-cut', 'Bodhisattva Rakta-Avalokitesvara, Second floor', '', 'Various lesser carved panels are scattered throughout this floor, with a notable number of female bodhisattvas among them, while in a few instances relief stupas replace or substitute for Buddha images. The seated bodhisattva Rakta-Avalokitesvara, with Amitabha Buddha in his jata headdress and an expanded lotus is seated between Tara (with varada mudra) on the left, and Bhrikuti (with her water pot) on the right. These belong to the smaller shrine next to the stairs leading to the third floor.', 'c12/_CAV3052.jpg', '2/2006', '', 1, 0, NULL, 42, 287, 0.08750000, 0.60167715, 'Arno Klein', 0, FALSE, NULL, FALSE)
