VALUES (387, 394, 12, 212, 'rock-cut', 'Bhadrasana Buddha', '', 'Bhadrasana Buddha on a throne with lions and wheel, flanked both by standing bodhisattvas and by standing Buddhas.  Large recumbent deer appear below, appropriately, since the Buddha displays the teaching gesture.  This image is in a smaller shrine next to the stairway leading from the second floor to the third.', 'c12/_CAV3053.jpg', '2/2006', '', 1, 0, NULL, 17, 420, 0.03541667, 0.88050314, 'Arno Klein', 0, FALSE, NULL, FALSE)
