VALUES (388, 388, 12, 212, 'rock-cut', 'Main shrine doorway, Second floor', '', '', 'c12/_CAV3054.jpg', '2/2006', '', 1, 0, NULL, 221, 123, 0.46041667, 0.25786164, 'Arno Klein', 0, FALSE, NULL, FALSE)
