VALUES (391, 391, 12, 212, 'rock-cut', 'Seated Buddha, main shrine - Second floor', '', 'The main shrine of the second floor houses a huge seated Buddha with the earth-touching (bhumisparsa) mudra; the earth goddess, Bhudevi, responding to his call, emerges from the floor at the left of the throne base. This support is formed by a lotus rather than the standard leonine throne-legs. Aparajita, over the prostrate Ganesa, occupies a position at the right and flying couples populate the upper section. Huge figures of Avalokitesvara (on the left), with the lotus and Buddha in his jata headdress, and Vajrapani (or Manjuvajra), holding the thunderbolt on an utpala) flank him, both heavily covered with darkened and damaged plaster.', 'c12/_CAV3057.jpg', '2/2006', '', 1, 0, NULL, 210, 46, 0.43750000, 0.09643606, 'Arno Klein', 0, FALSE, NULL, FALSE)
