INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (405, 405, 12, 312, 'rock-cut', 'Buddha in Padmasana - (first on the left wall) Third floor', '', 'On the shorter side walls, dramatically revealed at either end of the long horizontal aisles are nine Buddha images. There are four at the left and five on the right. Padmasana Buddhas (with legs crossed) at either end of the fifth (most rearward) and second aisles flank  bhadrasana images (with feet down) at either ends of aisles four and three, while an "extra" padmasana image at the end of the front aisle faces the entrance to this upper floor at the left. These deeply carved images, with their attendant bodhisattvas, elaborate thrones and converging celestial couples fill the hall with a dramatically silent energy. The first two at the right are distinguished by trees carved above them and extra attendant musicians. Often the bodhisattvas are hard to distinguish, lacking very specific attributes, but there are a number of representations of Avalokitesvara with his expected lotus and  Buddha in headdress and Vajrapani with the vajra lifted up on a long floral stem.', 'c12/_CAV3071.jpg', '2/2006', '', 1, 0, NULL, 88, 305, 0.18333333, 0.67180617, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
