INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (458, 458, 12, 212, 'rock-cut', 'Avalokitesvara - middle floor (between First and Second floor)', '', 'Near the top of the staircase leading to the second floor, one can enter a large pillared chamber fronted by two pillars with a beautifully carved lotus on the ceiling. Two mandalas, along with various seated Buddhas and bodhisattvas, have been carved.  The mandalas flank the central image of a bhumisparsa Buddha, with Avalokitesvara and Vajrapani.  On the right wall a large triad represents seated Avalokitesvara flanked by Jambhala on the left and Tara on the right (seen here), and with two smaller female devotees at the farthere left.  Various other small panels appear on the three walls, including a triad of goddesses above this right walls mandala.', 'c12/_CAV3124.jpg', '2/2006', '', 1, 0, NULL, NULL, NULL, NULL, NULL, 'Arno Klein', 0, FALSE, NULL, FALSE)
