VALUES (470, 470, 12, 12, 'rock-cut', 'Mandala with Buddha and Bodhisattvas- First floor', '', 'There are numerous small Buddha or bodhisattva panels elsewhere in the hall on the first floor. The most significant of all being the various mandala configurations.  Typically showing eight seated bodhisattvas surround a central seated Buddha, they appear both on the wall at the left of the entrance to the pillared shrine vestibule and at two points in the chamber (seen here) that leads to the staircase at front right.\r\n\r\nOn top of the mandala is a four-armed Tara; she and Cunda (at the left) flank a Buddha attended by Avalokitesvara (with lotus) at the left and Manjusri (with book) at the right. \r\n', 'c12/_CAV3136.jpg', '2/2006', '', 1, 0, NULL, 410, 313, 0.85416667, 0.47932619, 'Arno Klein', 0, FALSE, NULL, FALSE)
