INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (519, 519, 12, 12, 'rock-cut', 'Bodhisattvas, main shrine - First floor', '', 'The main shrine on the first floor has a huge teaching Buddha seated in the dhyanasana.  He is surrounded with seated rather than standing bodhisattvas.  Eight in number, and differentiated by their varied attributes, they may well represent an astabodhisattva (8-bodhisattva) mandala.\r\n\r\nThe bodhisattvas can be distinguished primarily by the objects each holds to the proper left.  On the left shrine wall, from front to rear, they hold: #1 a flag or a staff, #2 a sword upraised, #3 a branching flower, and #4 an expanded lotus. The crowns are very much the same, except for that of Avalokitesvara (nearest to the Buddha). The two nearest the front also hold roundish objects in the proper right hand, one with a tri-lobed decoration on its front; the upper right hands of the other two are missing. The seated bodhisattvas on the right wall have, from the front: #1 a spray of (lotus?) flowers, #2 a book on a flower #3 (missing), #4 a stemmed device, oval shaped, composed of jewels, perhaps backing a now broken flower.  Above, on each side, there are small Buddhas in the meditation pose.\r\n', 'c12/_CAV3185.jpg', '2/2006', '', 1, 0, NULL, 49, 633, 0.10208333, 0.96937213, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
