VALUES (521, 520, 12, 12, 'rock-cut', 'Bodhisattvas, main shrine - First floor', '', 'The main shrine on the first floor has a huge teaching Buddha seated in the dhyanasana.  He is surrounded with seated rather than standing bodhisattvas.  Eight in number, and differentiated by their varied attributes, they may well represent an astabodhisattva (8-bodhisattva) mandala.\r\n\r\nThe bodhisattvas can be distinguished primarily by the objects each holds to the proper left.  On the left shrine wall, from front to rear, they hold: #1 a flag or a staff, #2 a sword upraised, #3 a branching flower, and #4 an expanded lotus. The crowns are very much the same, except for that of Avalokitesvara (nearest to the Buddha). The two nearest the front also hold roundish objects in the proper right hand, one with a tri-lobed decoration on its front; the upper right hands of the other two are missing. The seated bodhisattvas on the right wall have, from the front: #1 a spray of (lotus?) flowers, #2 a book on a flower #3 (missing), #4 a stemmed device, oval shaped, composed of jewels, perhaps backing a now broken flower.  Above, on each side, there are small Buddhas in the meditation pose.', '_CAV3187.jpg', '2/2006', '', 0, 0, NULL, 50, 633, 0.10416667, 1.31875000, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
