VALUES (548, 548, 12, 12, 'rock-cut', 'Cistern chamber', 'cistern', 'The shorter left (north) stairway in the courtyard, near what appears to have been an original drainage tunnel leads past one of the various Buddha panels placed throughout the cave to a  square chamber with a still-functioning cistern near the center.  It is fronted by a very plain colonnade, and has four similar pilasters on each of the three walls.', 'c12/_CAV3214.jpg', '2/2006', '', 1, 0, NULL, 112, 448, 0.23333333, 0.68606432, 'Arno Klein', 0, FALSE, NULL, FALSE)
