VALUES (549, 549, 12, 12, 'rock-cut', 'Subsidiary structures and shrines', '', 'A large unfinished chamber is seen at the right of the court with a pillared area above, access to which is gained by the stairs to the middle story.  The nearby window lights the inner staircase at this level while the window on the opposite court wall, at a higher level, lights the opposite staircase leading to the upper floor.', 'c12/_CAV3215.jpg', '2/2006', '', 1, 0, NULL, 362, 446, 0.75416667, 0.68300153, 'Arno Klein', 0, FALSE, NULL, FALSE)
