VALUES (550, 550, 12, 12, 'rock-cut', 'Open courtyard', '', 'Inside the spacious courtyard (107'' wide by about 46''deep) one can climb on the right (south) side via a steep stairway to an upper level (the portion over the entrance doorway now broken away) where one could enter another plain chamber on either side.', 'c12/_CAV3216.jpg', '2/2006', '', 1, 0, NULL, 224, 449, 0.46666667, 0.68759571, 'Arno Klein', 0, FALSE, NULL, FALSE)
