VALUES (570, 570, 11, 311, 'rock-cut', 'Third floor - relief panel', 'Seated Buddha', 'The upper story has been thickly plastered with a coarse brown mix, even in the shrine, whereas the sculptures are typically coated with an eighth of an inch and often much more of fine lime plaster. In various places this goes over the brown wall plaster and sometimes covers over a large surrounding area.  Thus it seems that the intrusions were cut into the already plastered wall. \r\n\r\nThis panel is in the left passage walls of the first doorway to the main pillared hall.', 'c11/_CAV3236.jpg', '', '', 1, 0, NULL, 53, 190, 0.11041667, 0.46228710, 'Arno Klein', 0, FALSE, NULL, FALSE)
