INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (620, 620, 14, 14, 'rock-cut', 'Facade', '', 'Splendidly decorated Cave 14 is a Hindu dedication that reflects the increasing focus on feminine divinities. This cave is also popularly called the Ravana ka khai (Ashes of Ravana).\r\nThe pillars of the front colonnade, except for that at the extreme left are poor cement reconstructions. The pilaster at the left with its fine female bracket, clearly derived from the type in Caves 21 and 17, is intact. Its counterpart at the right is broken beyond recognition.', '_CAV2680.jpg', '2/2006', '', 0, 0, NULL, 234, 536, 0.48750000, 1.11666667, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (621, 621, 14, 14, 'rock-cut', 'Facade', '', 'Splendidly decorated Cave 14 is a Hindu dedication that reflects the increasing focus on feminine divinities. This cave is also popularly called the Ravana ka khai (Ashes of Ravana).\r\nThe pillars of the front colonnade, except for that at the extreme left are poor cement reconstructions. The pilaster at the left with its fine female bracket, clearly derived from the type in Caves 21 and 17, is intact. Its counterpart at the right is broken beyond recognition.', 'c14/_CAV2681.jpg', '2/2006', '', 1, 0, NULL, 236, 593, 0.49166667, 0.89172932, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (622, 622, 14, 14, 'rock-cut', 'Main Hall', 'Columns', 'Splendidly decorated Cave 14 is a Hindu dedication that reflects the increasing focus on feminine divinities. (view of the right wall leading towards the garbhagriha).\r\nThe twelve pillars of the hall, their purnaghata capitals restrained by the dimensions of the original block, and with extensions above (only a few completed) show riders on fabulous animals with imaginative kirttimukhas.  These owe much to their ornate prototypes in Cave 21 and 17; conventional dwarfs sit on the corners of the high square bases, enclosing panels primarily depicting loving couples or dallying triads. The shafts of these hall pillars are handsomely ornamented, with minor but distinct variations in their decorative bands.  They are arranged in related pairs (following Vakataka precedents) matched either according to their adjacency, or by their disposition at the same points on opposite sides of the hall.', 'c14/_CAV2682.jpg', '2/2006', '', 1, 0, NULL, 249, 379, 0.51875000, 0.56992481, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (623, 623, 14, 14, 'rock-cut', 'Main hall', 'columns', 'Splendidly decorated Cave 14 is a Hindu dedication that reflects the increasing focus on feminine divinities.(partial view of the left wall leading towards the garbhagriha).\r\nThe twelve pillars of the hall, their purnaghata capitals restrained by the dimensions of the original block, and with extensions above (only a few completed) show riders on fabulous animals with imaginative kirttimukhas.  These owe much to their ornate prototypes in Cave 21 and 17; conventional dwarfs sit on the corners of the high square bases, enclosing panels primarily depicting loving couples or dallying triads. The shafts of these hall pillars are handsomely ornamented, with minor but distinct variations in their decorative bands.  They are arranged in related pairs (following Vakataka precedents) matched either according to their adjacency, or by their disposition at the same points on opposite sides of the hall.', 'c14/_CAV2683.jpg', '2/2006', '', 1, 0, NULL, 135, 360, 0.28125000, 0.54135338, 'Arno Klein', 0, FALSE, NULL, FALSE)
