VALUES (624, 624, 14, 14, 'rock-cut', 'Main hall', 'columns', 'Splendidly decorated Cave 14 is a Hindu dedication that reflects the increasing focus on feminine divinities.(view of the left wall).\r\nThe twelve pillars of the hall, their purnaghata capitals restrained by the dimensions of the original block, and with extensions above (only a few completed) show riders on fabulous animals with imaginative kirttimukhas.  These owe much to their ornate prototypes in Cave 21 and 17; conventional dwarfs sit on the corners of the high square bases, enclosing panels primarily depicting loving couples or dallying triads. The shafts of these hall pillars are handsomely ornamented, with minor but distinct variations in their decorative bands.  They are arranged in related pairs (following Vakataka precedents) matched either according to their adjacency, or by their disposition at the same points on opposite sides of the hall.', 'c14/_CAV2684.jpg', '2/2006', '', 1, 0, NULL, 135, 364, 0.28125000, 0.54736842, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
