VALUES (638, 638, 14, 14, 'rock-cut', 'Siva and Parvati playing chausar', '', 'Siva and Parvati are playing chausar in their rocky abode on Mount Kailasa, while the elephant-headed Ganesa and other attendants observe them. Siva (with one of his four hands) grabs Parvati''s hand in the course of their sometimes acrimonious game, while the ganas torment the long-suffering bull Nandi below.', 'c14/_CAV2698.jpg', '2/2006', '', 1, 0, NULL, 408, 433, 0.85000000, 0.65112782, 'Arno Klein', 0, FALSE, NULL, FALSE)
