INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (656, 656, 14, 14, 'rock-cut', 'Dwarapala (left of main shrine doorway - detail)', 'Female figure', 'The garbhagriha doorway is flanked by Early Kalacuri type of dvarapalas accompanied by attendant figures equally "borrowed" from Early Kalacuri forms.\r\nLife-size females, with their own female attendants (two on the left), directly flank the shrine doorway, assuming something of both the position and function of the huge dvarapalas nearby. There are also two carved female figures (again with their own female attendants) at the bottom of the otherwise plain shrine doorway, these further emphasize the feminine focus of this cave.', 'c14/_CAV2716.jpg', '2/2006', '', 1, 0, NULL, 189, 199, 0.39375000, 0.29924812, 'Arno Klein', 0, FALSE, NULL, FALSE)
