VALUES (662, 662, 14, 14, 'rock-cut', 'Dwarapala (right of main shrine doorway - detail)', 'River goddess - Yamuna', 'The garbhagriha doorway is flanked by Early Kalacuri type of dvarapalas accompanied by attendant figures equally "borrowed" from Early Kalacuri forms.\r\nThis detail shows the representation of the river goddess Yamuna on her turtle with umbrella supported by a female attendant.', 'c14/_CAV2722.jpg', '2/2006', '', 1, 0, NULL, 335, 195, 0.69791667, 0.29323308, 'Arno Klein', 0, FALSE, NULL, FALSE)
