INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (686, 686, 14, 14, 'rock-cut', 'Saptamatrika (detail)', '', 'The Seven Mothers, attended by Virabhadra at the left and Ganesa, the skeletal Kala (Time) and with the deadly goddess Kali at his right, appear at the far (right) end of the ambulatory passage.  This group of mother goddesses is better preserved than its counterpart in Cave 21, from which its style and iconographic features clearly derive. Each of the figure is easily identifiable by its vahana, for example, Brahmi with her goose or hamsa, Mahesvari with her bull, Kumari with her peacock, Vaisnavi with the sunbird Garuda, Varahi with her boar, Indrani with her elephant, and Saraswati with her owl.  All have their children, either seated on their laps or trying to climb up onto them.', 'c14/_CAV2746.jpg', '2/2006', '', 1, 0, NULL, 99, 644, 0.20625000, 0.96842105, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
