VALUES (694, 694, 14, 14, 'rock-cut', 'Dwarapala - right of shire doorway', 'Female figure', 'Life-size females, with their own female attendants (two on the left), directly flank the shrine doorway, assuming something of both the position and function of the huge dvarapalas nearby. There are also two carved female figures (again with their own female attendants) at the bottom of the otherwise plain shrine doorway, these further emphasize the feminine focus of this cave.', 'c14/_CAV2754.jpg', '2/2006', '', 1, 0, NULL, 293, 198, 0.61041667, 0.29774436, 'Arno Klein', 0, FALSE, NULL, FALSE)
