VALUES (702, 702, 14, 14, 'rock-cut', 'Durga on lintel', '', 'Also of particular significance is the small panel showing Durga--which appears as part of an unfinished frieze composed largely of active dwarfs--slaying the buffalo at the center of the beam directly above the two rear central hall pillars; such a positioning--like that of Lakulisa in Caves 19 and 21--clearly connects the cave with the image shown, and it is scarcely an accident that both the broken image once in the shrine and the crucially placed image at the rear of the hall show the actual defeat of the demon, thus completing the "narrative" sequence started in the front aisle.', 'c14/_CAV2762.jpg', '2/2006', '', 1, 0, NULL, 211, 638, 0.43958333, 0.95939850, 'Arno Klein', 0, FALSE, NULL, FALSE)
