INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (881, 881, 3, 3, 'rock-cut', 'Facade', 'Facade', 'Facade view of Cave 3 and also in view are caves 4 through 6. Cave 3 once had a deep porch leading into the interior through a central doorway, and fronted by a two pillared colonnade.  An impressively wide monolithic staircase must have once had steps leading to the basin of the seasonal waterfall.  This area in front shows remnants of a fine heavy molded basement, of a type commonly found in both Vakataka and Early Kalacuri prototypes.\r\nOutside the cave, at the left of the broken porch, there is an unusual pillared window; it is purely a recent cement reconstruction and totally inauthentic, except for the carved floral borders at the left.', 'c3/_CAV2941.jpg', '', '', 1, 0, NULL, 327, 463, 0.68125000, 0.85740741, 'Arno Klein', 10, FALSE, NULL, FALSE)
