INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (887, 888, 12, 12, 'rock-cut', 'Facade', '', 'Cave 12 is an even more ambitious excavation than Cave 11, although its facade is equally severe, except for the two handsomely decorated entrance pillars at the lower level. Although the ornamentation is kept within the squared confines of the block, it is particularly exuberant, its purnaghata motif enclosed not merely by foliate forms above, but by vigorous dwarfs, a number of them standing and also paired, rather than (as in the past) simply squatting.  Like all of the other  (undecorated) pillars these have handsome molded bases and equally severe capital extensions, except (in these two pillars alone) for the fine decoration on the front.', 'c12/_CAV2947.jpg', '2/2006', '', 1, 0, NULL, 9, 633, 0.01875000, 0.96937213, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
