VALUES (899, 899, 12, 12, 'rock-cut', 'Mandala with Buddha and Bodhisattvas - First floor', '', 'There are numerous small Buddha or bodhisattva panels elsewhere in the hall on the first floor. The most significant of all being the various mandala configurations.  Typically showing eight seated bodhisattvas surround a central seated Buddha, they appear both on the wall at the left of the entrance to the pillared shrine vestibule and at two points in the chamber (seen here) that leads to the staircase at front right.\r\n\r\nOn top of the mandala is a four-armed Tara; she and Cunda (at the left) flank a Buddha attended by Avalokitesvara (with lotus) at the left and Manjusri (with book) at the right.', 'c12/_CAV2959.jpg', '2/2006', '', 1, 0, NULL, NULL, NULL, NULL, NULL, 'Arno Klein', 0, FALSE, NULL, FALSE)
