INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (909, 909, 15, 15, 'rock-cut', 'Nandi mandapa', '', 'Sometimes called a Dancing Hall, this monolithic structure may have been a shrine for the devoted bull Nandi. Despite its necessarily low placement, this shrine was associated with the lingam in the upper floor.  However, it had to be cut at its present low level because the earlier Buddhist excavators had already removed some or most of the matrix from the area above its roof. It is likely that the handsome loose image of Siva''s bull that sits on the floor of the upper pillared hall on axis with the lingam, was once placed upon the roof of this courtyard edifice, in order to allow it better to attend the lingam within the cave.  This would explain the anomalously flat treatment of the roof, with its low central platform, probably originally for the Nandi iself.', 'c15/_CAV2467.jpg', '2/2006', '', 1, 0, NULL, 209, 268, 0.43541667, 0.42338073, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (910, 910, 15, 15, 'rock-cut', 'cistern chamber', '', 'At the right (south) of the court, there is a large cistern chamber, and an upper chamber gained by a flight of steps.  Another large plain chamber (now locked and used for storage) is cut in the left (north) court wall. It contains six cells, two each at left, right, and rear, but since they are still somewhat unfinished, their intended purpose is not clear; however we can assume, because of the disposition of the rear cells, that no shrine was intended.', 'c15/_CAV2468.jpg', '2/2006', '', 1, 0, NULL, 430, 320, 0.89583333, 0.50552923, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
