VALUES (1003, 1003, 15, 215, 'rock-cut', 'Vishnu reclining on the endless serpent, Sesha', '', 'Vishnu, containing the universe, lies dormant on the waters represented by the serpent, while his consort, Laksmi, representing the vegetative energy, disturbs his sleep, to start the process of creation; the first manifestation is the god Brahma, who appears above on a lotus that sprouts upward from Vishnu''s navel.  His four attributes are personified below, along with two demons, shown as dwarfs at the lower right. \r\n\r\n', 'c15/_CAV2532.jpg', '2/2006', '', 1, 0, NULL, 430, 182, 0.89583333, 0.35203095, 'Arno Klein', 0, FALSE, NULL, FALSE)
