VALUES (1004, 1004, 15, 215, 'rock-cut', 'Krishna supporting Mount Govardhana', '', 'Krishna, the eighth incarnation of Vishnu, lifts up and shelters the cowherds under the mountain, to protect them from the anger of Indra, the storm god, whose offerings he had appropriated for himself.  The herds of the villagers surround him, and a dwarf, perhaps representing the powers within the earth, appears beneath his foot. \r\n\r\n', 'c15/_CAV2533.jpg', '2/2006', '', 1, 0, NULL, 431, 142, 0.89791667, 0.27466151, 'Arno Klein', 0, FALSE, NULL, FALSE)
