VALUES (1037, 1037, 15, 15, 'rock-cut', 'Nandi mandapa', '', 'Sometimes called a Dancing Hall, this monolithic structure may have been a shrine for the devoted bull Nandi. Despite its necessarily low placement, this shrine was associated with the lingam in the upper floor.  However, it had to be cut at its present low level because the earlier Buddhist excavators had already removed some or most of the matrix from the area above its roof. It is likely that the handsome loose image of Siva''s bull that sits on the floor of the upper pillared hall on axis with the lingam, was once placed upon the roof of this courtyard edifice, in order to allow it better to attend the lingam within the cave.  This would explain the anomalously flat treatment of the roof, with its low central platform, probably originally for the Nandi iself.', 'c15/_CAV2608.jpg', '', '', 1, 0, NULL, 348, 279, 0.72500000, 0.44075829, 'Arno Klein', 10, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
