VALUES (1054, 975, 15, 215, 'rock-cut', 'Siva Killing the demon Andhaka', '', 'Siva impaling (with his trident) the demon Andhaka, while the skeletal goddess Kali, with an equally furious energy, catches and absorbs the demon''s destructively poisonous blood in the skull-cup that she holds.', 'c15/_CAV2493.jpg', '2/2006', '', 1, 0, NULL, 28, 501, 0.05833333, 0.96905222, 'Arno Klein', 0, FALSE, NULL, FALSE)
