VALUES (1055, 976, 15, 215, 'rock-cut', 'Siva Dancing (Siva Nataraja)', '', 'The second panel along the left wall shows Siva furiously dancing (Siva Nataraja), energizing the seemingly universal space within which he is contained with the powerful action of his massive form and his many arms.  His drummer, with three large drums, sits at the left, while flutists and other percussionists appear at the right.  Celestials (including bird-legged kinnaras) soar above.)', 'c15/_CAV2499.jpg', '2/2006', '', 1, 0, NULL, 30, 499, 0.06250000, 0.96518375, 'Arno Klein', 0, FALSE, NULL, FALSE)
