VALUES (1057, 990, 15, 215, 'rock-cut', 'Ravana shaking Kailasa', '', 'The many-headed many-armed demon king of Lanka, possessor of great strength, gets beneath Mount Kailasa, Siva', 'c15/_CAV2515.jpg', '2/2006', '', 1, 0, NULL, 30, 488, 0.06250000, 0.94390716, 'Arno Klein', 0, FALSE, NULL, FALSE)
