VALUES (1059, 995, 15, 215, 'rock-cut', 'Vishnu takes three great strides (Trivikrama)', '', 'Vishnu in his fifth incarnation as the dwarf (Vamana) wins back the universe for the gods by encompassing it with three vast strides.', 'c15/_CAV2519.jpg', '2/2006', '', 1, 0, NULL, 19, 475, 0.03958333, 0.91876209, 'Arno Klein', 0, FALSE, NULL, FALSE)
