VALUES (1062, 1000, 15, 215, 'rock-cut', 'Vishnu on his Sun-bird, Garuda, rescuing the elephant - Gajendramoksha', '', 'The elephant king, Gajendra, (at the lower right) was caught by a crocodile, but was saved when he prayed to Vishnu for salvation.  The god, on his mount, descends for the rescue.', 'c15/_CAV2527.jpg', '2/2006', '', 1, 0, NULL, 10, 437, 0.02083333, 0.84526112, 'Arno Klein', 0, FALSE, NULL, FALSE)
