VALUES (1064, 1064, 15, 215, 'rock-cut', 'Lingodbhavamurti', '', 'Siva emerging from the lingam. (Lingodbhavamurti) Challenged to find the extremities of Shiva''s limitless lingam, Brahma (as a hamsa or swan) flies upward, while Vishnu (as a rooting boar) snouts downward; but neither (seen also standing at either side with their characteristic attributes) is able to discover its extremities, and thus offer him their praise.', 'c15/_CAV2540.jpg', '2/2006', '', 1, 0, NULL, 368, 117, 0.76666667, 0.22630561, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
