VALUES (1065, 4486, 15, 215, 'rock-cut', 'Siva emerging from the lingam', '', 'Siva springs forth from the lingam to save his young devotee Markandeya from Yama, the god of death, seen at the right with his noose.', 'c15/_CAV2542.jpg', '2/2006', '', 1, 0, NULL, 9, 462, 0.01875000, 0.89361702, 'Arno Klein', 0, FALSE, NULL, FALSE)
