INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (1218, 528, 12, 12, 'rock-cut', 'Tara, main shrine, Second floor', '', 'In the main shrine a seated female bodhisattva, probably Tara, her proper right hand in varada mudra and the other holding a long-stemmed flower, appears on the left (north) front shrine wall. While an image of the fat Jambhala occupies the right, one foot on an elaborate lotus pedestal. In his proper right hand he holds a citron, while the other holds a curiously long mongoose skin which hangs down. His proper right foot rests upon an expansive lotus pedestal.', 'c12/_CAV4331.jpg', '2/2006', '', 1, 0, NULL, 43, 638, 0.08958333, 0.97702910, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (1219, 1219, 12, 12, 'rock-cut', 'Jambhala, main shrine, Second floor', '', 'In the main shrine a seated female bodhisattva, probably Tara, her proper right hand in varada mudra and the other holding a long-stemmed flower, appears on the left (north) front shrine wall. While an image of the fat Jambhala occupies the right, one foot on an elaborate lotus pedestal. In his proper right hand he holds a citron, while the other holds a curiously long mongoose skin which hangs down. His proper right foot rests upon an expansive lotus pedestal.', 'c12/_CAV4332.jpg', '2/2006', '', 1, 0, NULL, NULL, NULL, NULL, NULL, 'Arno Klein', 0, FALSE, NULL, FALSE)
