INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (1228, 1228, 12, 12, 'rock-cut', 'Seated Buddha, main shrine - Second floor', '', 'The main shrine of the second floor houses a huge seated Buddha with the earth-touching (bhumisparsa) mudra; the earth goddess, Bhudevi, responding to his call, emerges from the floor at the left of the throne base. This support is formed by a lotus rather than the standard leonine throne-legs. Aparajita, over the prostrate Ganesa, occupies a position at the right and flying couples populate the upper section. Huge figures of Avalokitesvara (on the left), with the lotus and Buddha in his jata headdress, and Vajrapani (or Manjuvajra), holding the thunderbolt on an utpala) flank him, both heavily covered with darkened and damaged plaster.', 'c12/_CAV4341.jpg', '2/2006', '', 1, 0, NULL, NULL, NULL, NULL, NULL, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
