VALUES (1249, 1249, 8, 8, 'rock-cut', 'Tara - main shrine', '', 'On the right of the seated image of Buddha is a standing figure of Tara with her lotus and rosary attended by converging dwarfs overhead with garlands.', 'c8/_CAV4362.jpg', '', '', 1, 0, NULL, 282, 171, 0.58750000, 0.26760563, 'Arno Klein', 0, FALSE, NULL, FALSE)
