VALUES (1260, 1260, 6, 6, 'rock-cut', 'Mandala (left of main seated Buddha)', '', 'The shrine is particularly interesting since besides the expected bhadrasana Buddha on his conventional but elaborate lion-throne, and the expected attendant bodhisattvas there are mandalas (as seen here). Each mandala is composed of nine seated Buddhas, on the left and right shrine walls. The Buddhas all sit against simplified thrones, decorated with vyalas and makaras.', 'c6/_CAV4373.jpg', '', '', 1, 0, NULL, 232, 61, 0.48333333, 0.18711656, 'Arno Klein', 0, FALSE, NULL, FALSE)
