VALUES (1924, 1924, 19, 19, 'rock-cut', 'Shrine doorway', '', 'Dwarapala on the right of the main shrine doorway.\r\nThe entrance to the shrine, as in Cave 20, was raised up very high, apparently to avoid a bad flaw which runs just below the top of the high but simple candrasila, from which steps rise to the shrine doorway. The latter is decorated with conventional floral bands like those in Cave 20, but somewhat less complex. All ultimately derive from Vakataka--and earlier--prototypes.', 'c19/_CAV2225.jpg', '2/2006', '', 1, 0, NULL, 274, 206, 0.57083333, 0.30563798, 'Arno Klein', 0, FALSE, NULL, FALSE)
