VALUES (1953, 1953, 17, 17, 'rock-cut', 'Kubera - unfinished', '', 'The pillared chamber at the left of Cave 17''s court opens into a small underground cistern at its rear (east) end; it is likely that had time allowed the reservoir would have been greatly enlarged, like the similarly located ones in Caves 21 and 14. In the similar chamber on the opposite side of the court a single male figure with a crown has been barely started (seen here). Although it is hard to be certain, this may well be a representation of Kubera, who is so often honored at the site.', 'c17/_CAV2254.jpg', '2/2006', '', 1, 0, NULL, 389, 396, 0.81041667, 0.68750000, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (1954, 1954, 17, 17, 'rock-cut', 'Vishnu', '', 'From the porch, which was provided with comfortable benches (now much restored) connecting the pillars on either side one can see a shrinelet for the pot-bellied and four faced Brahma on the right, facing a similar shrinelet with a standing Vishnu on the left.  As expected, the priestly Brahma wears a jata (ascetic''s) headdress, while the more regal Vishnu wears a crown.  Vishnu''s hands are broken, but Brahma''s hands show (from the left) the rosary, abhaya (reassurance) mudra, broken (but probably held amrita flask), and (perhaps) a bent danda.  Both gods are honored by flying dwarfs, and by female attendants below.  The latter are probably goddesses, but are hard to identify.  Perhaps the figure to Brahma''s proper left is his consort Saraswati, with her water-jug, and the other Savitri.', 'c17/_CAV2255.jpg', '2/2006', '', 1, 0, NULL, 72, 371, 0.15000000, 0.64409722, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
