INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (1958, 1958, 17, 17, 'rock-cut', 'Female bracket figures', '', 'Emphasis on female figures in the cave is most obvious from the female brackets. These figures, with their attendants, both standing and flying, line the axis of the cave, while both the front and rear center pillars have equally beautiful brackets on their rear faces, the important rear pillars also having them on the front face.  Similar to Cave 21, these female bracket figures generally have an attendant female (sometimes a female dwarf) on one side and an old and/or crippled man with a cane on the other.', 'c17/_CAV2259.jpg', '2/2006', '', 1, 0, NULL, 214, 350, 0.44583333, 0.60763889, 'Arno Klein', 0, FALSE, NULL, FALSE)
