INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (1960, 1960, 17, 17, 'rock-cut', 'Female bracket figures', '', 'Emphasis on female figures in the cave is most obvious from the female brackets. These figures, with their attendants, both standing and flying, line the axis of the cave, while both the front and rear center pillars have equally beautiful brackets on their rear faces, the important rear pillars also having them on the front face.  Similar to Cave 21, these female bracket figures generally have an attendant female (sometimes a female dwarf) on one side and an old and/or crippled man with a cane on the other.\r\nThis emphasis on the feminine which has been emerging throughout the Early Kalacuri period extends to the elaborate decoration of the bases of the rear central pair of pillars. All four sides (where fully completed) have carvings of a beautiful female occupying the central panel, with attendant males on either side.', 'c17/_CAV2261.jpg', '2/2006', '', 1, 0, NULL, 245, 208, 0.51041667, 0.36111111, 'Arno Klein', 0, FALSE, NULL, FALSE)
