INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (1961, 1961, 17, 17, 'rock-cut', 'Main hall', '', 'The interior space is filled with eight huge pillars, disposed in two equally spaced groups of four on either side of a widened central space leading to the shrine. There is no shrine antechamber, although an ambulatory surrounds the shrine; and for the first time one both entered and left the ambulatory through carefully defined doorways.', 'c17/_CAV2262.jpg', '2/2006', '', 1, 0, NULL, 245, 208, 0.51041667, 0.36111111, 'Arno Klein', 0, FALSE, NULL, FALSE)
