INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (1962, 1962, 17, 17, 'rock-cut', 'Ganesa', '', 'Broken-tusked sonof Siva, Ganesa, at sits on the left of the main mandapa with a cobra around his waist and holding his axe, a rosary, and a flower, while consuming laddus. Below Ganesa are music-making dwarfs, that at the right with a stringed instrument, while the other, painfully constricted, playing cymbals.', 'c17/_CAV2263.jpg', '2/2006', '', 1, 0, NULL, 100, 311, 0.20833333, 0.53993056, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (1963, 1963, 17, 17, 'rock-cut', 'Mahisasuramardini', '', 'Siva''s consort Durga sits to the right of the main mandapa, triumphing over the buffalo demon. She holds the trident, the sword, and the cakra (wheel).', 'c17/_CAV2264.jpg', '2/2006', '', 1, 0, NULL, 392, 314, 0.81666667, 0.54513889, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (1964, 1964, 17, 17, 'rock-cut', 'Shrine doorway', '', 'The shrine doorway decoration announces a dependency on Cave 21, for it is clearly a somewhat less successful copy of that great portal''s rich design.  The decoration is only half-finished, and some of the details, such as the figures on the unfinished left jamb, are very fine; but the whole lintel carving reduces the vigor of Cave 21''s design and overcrowds the converging celestials above, so that much of the impact is lost.', 'c17/_CAV2265.jpg', '2/2006', '', 1, 0, NULL, 244, 166, 0.50833333, 0.28819444, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
