VALUES (1970, 1970, 17, 17, 'rock-cut', 'Dwarapala', '', 'The connection between Cave 17 and 21 is most apparent through the images of these dwarapalas. They have much of the same "Elephanta"-type grace that survives, a bit tenuously, in the related figures in Cave 21.  And they are similarly posed, each holding a lotus in the proper right hand.  As in most Early Kalacuri examples the expected dwarfs above fly toward the shrine, while a single attendant below functions as an ayudhapurusa. This is suggested by the burly form and the mustachioed mien of the dwarf beside the right dvarapala, who appears to hold both a lotus flower and a noose. The other figure is harder to "read" as an ayudhapurusa, for he appears rather old and/or crippled, leaning on his staff.  But he is quite directly copied from a counterpart in Cave 26, who also has the three tufts (of hair?) on his forehead and is possibly wearing the hair behind in a snood.', 'c17/_CAV2271.jpg', '2/2006', '', 1, 0, NULL, 206, 168, 0.42916667, 0.29166667, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (1971, 1971, 17, 17, 'rock-cut', 'Shrine doorway', '', 'The shrine doorway decoration announces a dependency on Cave 21, for it is clearly a somewhat less successful copy of that great portal''s rich design.  The decoration is only half-finished, and some of the details, such as the figures on the unfinished left jamb, are very fine; but the whole lintel carving reduces the vigor of Cave 21''s design and overcrowds the converging celestials above, so that much of the impact is lost.', 'c17/_CAV2272.jpg', '2/2006', '', 1, 0, NULL, 244, 150, 0.50833333, 0.26041667, 'Arno Klein', 0, FALSE, NULL, FALSE)
