VALUES (1997, 1997, 17, 17, 'rock-cut', 'Dwarapala - detail', '', 'The connection between Cave 17 and 21 is most apparent through the images of these dwarapalas. They have much of the same "Elephanta"-type grace that survives, a bit tenuously, in the related figures in Cave 21.  And they are similarly posed, each holding a lotus in the proper right hand.  As in most Early Kalacuri examples the expected dwarfs above fly toward the shrine, while a single attendant below functions as an ayudhapurusa. This is suggested by the burly form and the mustachioed mien of the dwarf beside the right dvarapala, who appears to hold both a lotus flower and a noose. The other figure is harder to "read" as an ayudhapurusa, for he appears rather old and/or crippled, leaning on his staff.  But he is quite directly copied from a counterpart in Cave 26, who also has the three tufts (of hair?) on his forehead and is possibly wearing the hair behind in a snood.', 'c17/_CAV2298.jpg', '2/2006', '', 1, 0, NULL, 285, 169, 0.59375000, 0.29340278, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
