INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (1999, 1999, 17, 17, 'rock-cut', 'Ganesa', '', 'Broken-tusked sonof Siva, Ganesa, at sits on the left of the main mandapa with a cobra around his waist and holding his axe, a rosary, and a flower, while consuming laddus. Below Ganesa are music-making dwarfs, that at the right with a stringed instrument, while the other, painfully constricted, playing cymbals.', 'c17/_CAV2300.jpg', '2/2006', '', 1, 0, NULL, 108, 319, 0.22500000, 0.55381944, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
