VALUES (2000, 2000, 17, 17, 'rock-cut', 'Main Hall', '', 'The interior space is filled with eight huge pillars, disposed in two equally spaced groups of four on either side of a widened central space leading to the shrine. There is no shrine antechamber, although an ambulatory surrounds the shrine; and for the first time one both entered and left the ambulatory through carefully defined doorways.', 'c17/_CAV2301.jpg', '2/2006', '', 1, 0, NULL, 169, 297, 0.35208333, 0.51562500, 'Arno Klein', 0, FALSE, NULL, FALSE)
