VALUES (2622, 2622, 32, 32, 'rock-cut', 'Penance of Bahubali (J6)', '', 'The Bahubali panel shows the sage (also called Gomatesvara) standing naked as always, while, over the course of time vine gradually grows up and around his silent form. The halo and umbrella (with tree above) attest to his spiritual significance, as do the celestial couples who offer him flowers and praise. Below, at either side, goddesses grasp the now-sacred foliage which spreads out from their upraised nearer hands.  A kneeling couple praises him and offers a lotus at the lower left.', 'c32/_CAV0824.jpg', '', '', 1, 0, NULL, 378, 609, 0.78750000, 1.26875000, 'Arno Klein', 0, FALSE, NULL, TRUE)
