INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (2624, 2624, 32, 32, 'rock-cut', 'Ambika (J6)', '', 'Ambika, at the right rear, sits on her lion holding a child and the noose. She is attended by a standing male with lotus at the left, and the Jain monk Varadatta, to whom she gave food on the opposite side; he holds his umbrella in one hand, praising (or requesting food from) her with the other. Above, delightfully agile monkeys steal some of the abundant fruit from the mango tree, which is flanked by breadfruit. Ambika''s pose is very similar to that of Sarvanabhuti (on the opposite wall), but the stem of her lotus footstool was lost when the rock in that area broke.\r\n', 'c32/_CAV0826.jpg', '', '', 1, 0, NULL, 388, 613, 0.80833333, 1.27708333, 'Arno Klein', 0, FALSE, NULL, TRUE)
