VALUES (3652, 3652, 10, 210, 'rock-cut', 'Bodhisattva Maitreya', 'Maitreya', 'Smaller but equally complex lateral arches, slightly varied in design, and supported by cushion-capitaled demi-pillars with dramatically projecting brackets, enclose niches with bodhisattvas attended by their associated goddesses. This bodhisattva (the flying dwarfs unfinished) may be identified as Maitreya, given the stupa in the crown. This niche has loving couples above.', 'c10/c10_16.jpg', '', '', 1, 0, NULL, 207, 98, 0.43125000, 0.31612903, 'Arno Klein', 0, FALSE, NULL, FALSE)
