VALUES (3658, 3658, 10, 210, 'rock-cut', 'Bodhisattva Avalokitesvara', 'Avalokitesvara', 'Smaller but equally complex lateral arches, slightly varied in design, and supported by cushion-capitaled demi-pillars with dramatically projecting brackets, enclose niches with bodhisattvas attended by their associated goddesses.  Avalokitesvara with the Buddha Amitabha in his jata headdress, holding an expanded lotus, and with antelope skin, appears in the right niche (seen here). Above the image is a delightful crowd of playful dwarfs.', 'c10/c10_20.jpg', '', '', 1, 0, NULL, 337, 102, 0.70208333, 0.32903226, 'Arno Klein', 0, FALSE, NULL, FALSE)
