VALUES (3662, 3662, 10, 210, 'rock-cut', 'Bodhisattva Prajnaparamita and Avalokitesvara', 'Bodhisattva', 'The large panels on the wall between the central and side arches were probably not part of the original conception of this cave, but are probably roughly contemporary intrusions, for they break the disciplined design scheme of the facade. A female and male bodhisattva, probably Prajnaparamita (with her book) and Avalokitesvara (with his lotus) appear at the left (seen here).', 'c10/c10_A.jpg', '', '', 1, 0, NULL, 228, 114, 0.47500000, 0.36774194, 'Arno Klein', 0, FALSE, NULL, FALSE)
