VALUES (3663, 3663, 10, 210, 'rock-cut', 'Instrusive immages', 'Buddha and Bodhisattva', 'The large panels on the wall between the central and side arches were probably not part of the original conception of this cave, but are probably roughly contemporary intrusions, for they break the disciplined design scheme of the facade. A female and male bodhisattva, probably Prajnaparamita (with her book) and Avalokitesvara (with his lotus) appear at the left.   At the right, we find a notable representation of a crowned Buddha, probably the first in these western caves, and possibly even anticipating related forms in eastern India where, during Pala times, it became increasingly popular.  The image, seated in dhyanasana on a three-lion throne,   and displaying the teaching gesture, is flanked by a seated Avalokitesvara with his lotus on the left, and a seated Manjusri, with his tiger-claw necklace and characteristic headdress on the right.   Just below, another Manjusri, with the same flower, appears, next to a Buddha on a lotus throne, curiously supported by nagas, since his hand is in the bhumisparsa mudra - a gesture connected with the earth rather than the waters. All three of the bodhisattvas just mentioned show varada mudra, the gesture of offering.', 'c10/c10_B-C-D.jpg', '', '', 1, 0, NULL, 312, 115, 0.65000000, 0.37096774, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
