VALUES (3676, 3676, 10, 10, 'rock-cut', 'Facade of the grand Caitya Cave 10, also called the Visvakarma Caitya Hall', 'Facade', 'The entablature over the courtyard colonnade is relieved, at its lower level, with a vigorous frieze composed in large part of elephants, bovines, deer, and boars running from either side. They move toward a focal point over the entrance to the cave, while fine panels of loving couples interspersed with roiling zoomorphic and floral forms occupy the upper range.  Still higher up, under the eave of the cave, still other couples, their greater size enhancing their legibility, appear with dwarf attendants between a framework of cushion-capitaled demi-pillars.', 'c10/c10_F3.jpg', '', '', 1, 0, NULL, 253, 444, 0.52598753, 0.70364501, 'Arno Klein', 0, FALSE, NULL, FALSE)
