INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (3713, 63, 10, 10, 'rock-cut', 'Seated Buddha', 'Buddha', 'The main hall, with its impressive colonnade, is focused upon a huge teaching Buddha, seated in the bhadrasana pose on a lion throne. The main image is flanked by standing attendant bodhisattvas: Avalokitesvara (with his long-stemmed lotus and what may be a ruined Amitabha in his jata headdress) to the left and Manjusri (a stupa in his crown) to the right.  Similarly, focusing the devotees'' attention in front of, rather than upon, the stupa, two pairs of celestial couples on either side, together with the bodhi (pipal) tree over the Buddha''s head, form a powerful honorific arch, enclosing the haloed image and the richly decorated throne. Although they can only be seen when approached, there is a large carved teaching padmasana Buddha on the right side of the stupa''s fronting projection, and an equally large bhadrasana image on the left, with very similar large bhadrasana images carved on the stupa''s drum. However, two panels remain uncut, one being very flawed, the other showing traces of the head being just started by the sculptor.', 'c10/c10_S4a.jpg', '', '', 2, 0, NULL, NULL, -50, NULL, NULL, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
