VALUES (3747, 63, 10, 10, 'rock-cut', 'Seated Buddha', 'Buddha with Stupa', 'The main hall, with its impressive colonnade, is focused upon a huge teaching Buddha, seated in the bhadrasana pose on a lion throne. The main image is flanked by standing attendant bodhisattvas: Avalokitesvara (with his long-stemmed lotus and what may be a ruined Amitabha in his jata headdress) to the left and Manjusri (a stupa in his crown) to the right.  Similarly, focusing the devotees'' attention in front of, rather than upon, the stupa, two pairs of celestial couples on either side, together with the bodhi (pipal) tree over the Buddha''s head, form a powerful honorific arch, enclosing the haloed image and the richly decorated throne.', 'c10/c10_S4nave.jpg', '', '', 1, 0, NULL, -8, 593, -0.01666667, 1.23541667, 'Arno Klein', 0, FALSE, NULL, TRUE)
ON CONFLICT (image_id) DO NOTHING;
