VALUES (3772, 3772, 10, 10, 'rock-cut', 'Sub-shrine at the right end of main porch', 'sub-shrine', 'Buddha panels appear over the pillared entrances of the cells at either end of the main porch. The right one has a number of carvings.  In the inner chamber, is a figure of Avalokitesvara, seated in the position of ease, making the gesture of offering in his proper right hand, and holding an expanded lotus in the other. The shrinelet doorway is recessed. Flanking the cell''s doorway on the left is Mahamayuri sits above her peacock, holding a feather in her hand.  She is paired with Bhrkuti, four-armed, on the right.  Of the twenty one small panels in this area which show seated male and female bodhisattvas or Buddhas, at least twenty show the same mudra - the gesture of offering - as seen in the large seated bodhisattva around which they are clustered.', 'c10/c10_S6F.jpg', '', '', 1, 0, NULL, 423, 372, 0.87941788, 0.58954041, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
