INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (3862, 3862, 11, 11, 'rock-cut', 'Bodhisattva Rakta-Avalokitesvara - cistern chamber', '', 'Coming into the great open court, a few subsidiary structures at the front have fallen away--one can climb, at the front left, to an upper level cistern chamber similar to that in Cave 12 and also still functioning. A conventional low seat runs along the margins of the room. A small chamber on the east side of the cistern chamber contains a number of images remarkable both in terms of style and iconography. The main image is that of bodhisattva Rakta-Avalokitesvara on the north wall, for he sits at the back of a chamber which once had an open two pillared front, now badly broken. The deeply set image, fronted by an inset candrasila, shows varada mudra, holds the lotus blossom and has Amitabha Buddha in dhyanamudra in his jata headdress. He sits in the yogic pose on a lotus throne raised upon a stem; the lions which generally support the throne and often must be seen as leonine throne-legs, here are freed from their burden to crouch beneath it. As expected, he is attended by Tara and Bhrikuti, both seated. Tara, at the left, holds the utpala and shows varada mudra, while the four armed Bhrikuti has the stupa in the headdress, a flask, staff and rosary, the proper upper right hand being broken. Above these female images, Buddhas sit, the one on the right with bhumisparsa mudra, while the other, remarkably, has his proper left hand in what appears to be varada mudra.', 'c11/c11_S1-3.jpg', '', '', 1, 0, NULL, 13, 248, 0.02708333, 0.57142857, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
