VALUES (3864, 3864, 11, 211, 'rock-cut', 'Seated Buddha - central shrine, second floor', '', 'Buddha seated on the lion throne, with his proper right hand "touching the earth" (bhumisparsa mudra). Bodhisattvas Avalokitesvara, with a lotus and Amitabha in his headdress, and Vajrapani, with a crown and vajra, stand at left and right. Single celestials with garlands converge upon the image from above. The throneback has the conventional elephant-vyala-makara combination. The same "earth-touching" Buddha is figured in similar shrines both to left and right.', 'c11/c11_S10mainI-17.jpg', '', '', 1, 0, NULL, 236, 31, 0.49166667, 0.10333333, 'Arno Klein', 0, FALSE, NULL, FALSE)
