VALUES (3881, 3881, 11, 211, 'rock-cut', 'Bodhisattvas', '', 'The deep chamber at the right end of the front aisle of the middle floor, entered via a finely designed but unfinished archway has a Buddha on a high undecorated throne base, showing dharmacakra mudra. Single male celestials fly above. Avalokitesvara appears on the left, with Amitabha in his jata headdress and an open lotus, while Vajrapani with a long stemmed flower on the right. There are three female and three male bodhisattvas at the left and right respectively, all wearing high and elaborate headdresses.', 'c11/c11_S13-23.jpg', '', '', 1, 0, NULL, 439, 168, 0.91458333, 0.56000000, 'Arno Klein', 0, FALSE, NULL, FALSE)
