VALUES (3902, 3902, 11, 211, 'rock-cut', 'Seated Buddha - First floor', '', 'At the center of the first floor''s front aisle an assertively projecting Buddha in a shallow shrine is seated in the pose of meditation. His lion throne, a scalloped throne cloth over its base, has the conventional throneback motifs above: elephants, vyalas, and makaras, the latter spouting scrolling foliage. He is flanked by the bodhisattvas Avalokitesvara (with lotus and Buddha in jata headdress), and a crowned Vajrapani. The latter holds a curiously warped vajra in his hand; some problem in the rock must have been responsible for this. Flying couples - crowded by the bodhisattvas'' haloes--converge upon the image from above.', 'c11/c11_S5-9.jpg', '', '', 1, 0, NULL, NULL, NULL, NULL, NULL, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
