VALUES (3940, 3940, 12, 12, 'rock-cut', 'Column detail - First floor', '', 'Although the ornamentation of all the pillars is kept within the squared confines of the block, the columns at the main entrance it is particularly exuberant, its purnaghata motif enclosed not merely by foliate forms above, but by vigorous dwarfs, a number of them standing and also paired, rather than simply squatting.  Like all of the other (undecorated) pillars these have handsome molded bases and equally severe capital extensions, except (in these two pillars alone) for the fine decoration on the front.', 'c12/c12_1stfloorentranceP.jpg', '', '', 1, 0, NULL, NULL, NULL, NULL, NULL, 'Arno Klein', 0, FALSE, NULL, FALSE)
