INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (3962, 3962, 12, 212, 'rock-cut', 'Tara or Cunda, main shrine, Second floor', '', 'In the main shrine a seated female bodhisattva, probably Tara, her proper right hand in varada mudra and the other holding a long-stemmed flower, appears on the left (north) front shrine wall. While an image of the fat Jambhala occupies the right, one foot on an elaborate lotus pedestal.  In his proper right hand he holds a citron, while the other holds a curiously long mongoose skin which hangs down. His proper right foot rests upon an expansive lotus pedestal.', 'c12/c12_2ndfloor-S3-44a.jpg', '', '', 1, 0, NULL, 201, 67, 0.41875000, 0.14046122, 'Arno Klein', 0, FALSE, NULL, FALSE)
