VALUES (3963, 3963, 12, 212, 'rock-cut', 'Tara or Cunda, main shrine, Second floor', '', 'In the main shrine a seated female bodhisattva, probably Tara, her proper right hand in varada mudra and the other holding a long-stemmed flower, appears on the left (north) front shrine wall. While an image of the fat Jambhala occupies the right, one foot on an elaborate lotus pedestal.  In his proper right hand he holds a citron, while the other holds a curiously long mongoose skin which hangs down. His proper right foot rests upon an expansive lotus pedestal.', 'c12/c12_2ndfloor-S3-44b.jpg', '', '', 1, 0, NULL, NULL, NULL, NULL, NULL, 'Arno Klein', 0, FALSE, NULL, FALSE)
