INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (3964, 3964, 12, 212, 'rock-cut', 'Bodhisattvas, main shrine Second floor', '', 'The main shrine of the second floor houses a huge seated Buddha with the earth-touching (bhumisparsa) mudra. Huge figures of Avalokitesvara (on the left), with the lotus and Buddha in his jata headdress, and Vajrapani (or Manjuvajra), holding the thunderbolt on an utpala) flank him, both heavily covered with darkened and damaged plaster. \r\n\r\nFour large differentiated bodhisattvas (as in the lower floor, but here standing) with associated small seated Buddhas above, appear on either sidewall. On the left, the first holds (in his proper right hand) a lotus flower; the second an indistinct flower; the third an upraised sword, the fourth (with a distinct stupa in his headdress) a flower.  On the right, the first holds a flower; the second a flag, the third an expanded lotus; and the fourth a book on an utpala.', 'c12/c12_2ndfloor-S3-45.jpg', '', '', 1, 0, NULL, NULL, NULL, NULL, NULL, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
