VALUES (3986, 3986, 12, 212, 'rock-cut', 'Seated Buddha, Second floor', '', 'This bhadrasana Buddha seated on a throne with lions and wheel is flanked both by standing bodhisattvas and by standing Buddhas.  Large recumbent deer appear below, appropriately, since the Buddha displays the teaching gesture.  This seated Buddha image is the central figure in the smaller shrine next to the stairs leading to the third floor.', 'c12/c12_2ndfloor-S4-24.jpg', '', '', 1, 0, NULL, NULL, NULL, NULL, NULL, 'Arno Klein', 0, FALSE, NULL, FALSE)
