VALUES (3988, 3988, 12, 212, 'rock-cut', 'Bodhisattva Rakta-Avalokitesvara, Second floor', '', 'Various lesser carved panels are scattered throughout this floor, with a notable number of female bodhisattvas among them, while in a few instances relief stupas replace or substitute for Buddha images.  The seated bodhisattva Rakta-Avalokitesvara, with Amitabha Buddha in his jata headdress and an expanded lotus is seated between Tara (with varada mudra) on the left, and Bhrikuti (with her water pot) on the right. These belong to the smaller shrine next to the stairs leading to the third floor.', 'c12/c12_2ndfloor-S4-26.jpg', '', '', 1, 0, NULL, 37, 283, 0.07708333, 0.59329140, 'Arno Klein', 0, FALSE, NULL, FALSE)
