VALUES (3991, 3991, 12, 212, 'rock-cut', 'Avalokitesvara and Vajrapani, main shrine doorway, Second floor', '', 'Avalokitesvara, with a broken (but probable) Buddha in his headdress and with rosary and expanded lotus, and Vajrapani (or Manjuvajra), with the thunderbolt, guard the entrance, standing on heavy lotus pedestals, with comfortably recumbent lions (now much broken) over defeated elephants on the door plinth nearby.', 'c12/c12_2ndfloorS3D.jpg', '', '', 1, 0, NULL, 221, 101, 0.46041667, 0.21174004, 'Arno Klein', 0, FALSE, NULL, FALSE)
