VALUES (3996, 3996, 12, 312, 'rock-cut', 'Seven meditating Buddhas - Third floor', '', 'Seven meditating Buddhas, seated upon a high shared platform, and each attended by garland-bearing celestials and with different trees above are carved along each of the main hall''s long rear walls at the left, while a similar row of teaching Buddhas is carved along the right rear wall. It is quite possible that they represent the seven historical Buddhas, the last being Sakyamuni himself.', 'c12/c12_3rdfl-12.jpg', '', '', 1, 0, NULL, NULL, NULL, NULL, NULL, 'Arno Klein', 0, FALSE, NULL, FALSE)
