VALUES (4092, 4092, 12, 12, 'rock-cut', 'Maitreya, min shrine doorway, First floor', '', 'Outside the main shrine are seated two bodhisattvas, Maitreya at the left, with a stupa in his crown and a branching nagakesara flower rising at his proper left, and Manjusri with his book supported by an utpala flower (on the right) guard the shrine doorway.', 'c12/c12_8.jpg', '', '', 1, 0, NULL, NULL, NULL, NULL, NULL, 'Arno Klein', 0, FALSE, NULL, FALSE)
