INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (4095, 4095, 12, 12, 'rock-cut', 'Facade', '', 'Cave 12 is an even more ambitious excavation than Cave 11, although its facade is equally severe, except for the two handsomely decorated entrance pillars at the lower level. Although the ornamentation is kept within the squared confines of the block, it is particularly exuberant, its purnaghata motif enclosed not merely by foliate forms above, but by vigorous dwarfs, a number of them standing and also paired, rather than (as in the past) simply squatting.  Like all of the other  (undecorated) pillars these have handsome molded bases and equally severe capital extensions, except (in these two pillars alone) for the fine decoration on the front.', 'c12/c12_F.jpg', '', '', 1, 0, NULL, 360, 375, 0.75000000, 0.57427259, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (4096, 4096, 12, 12, 'rock-cut', 'Cunda, main shrine - First floor', '', 'The main shrine on the first floor has a huge teaching Buddha seated in the dhyanasana. Female bodhisattvas, both seated, fill the space on the inner front wall. Tara, four-armed, is on the right (south) with rosary, lotus, and kamandalu (water jar), while Cunda with a broken flower, and the proper right hand stretched downward in varada mudra appears on the left.', 'c12/c12_S1-9a.jpg', '', '', 1, 0, NULL, NULL, NULL, NULL, NULL, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (4097, 538, 12, 12, 'rock-cut', 'Bodhisattvas, main shrine - First floor', '', 'The main shrine on the first floor has a huge teaching Buddha seated in the dhyanasana. He is surrounded with seated rather than standing bodhisattvas. Eight in number, and differentiated by their varied attributes, they may well represent an astabodhisattva (8-bodhisattva) mandala. The bodhisattvas can be distinguished primarily by the objects each holds to the proper left. On the left shrine wall, from front to rear, they hold: #1 a flag or a staff, #2 a sword upraised, #3 a branching flower, and #4 an expanded lotus. The crowns are very much the same, except for that of Avalokitesvara (nearest to the Buddha). The two nearest the front also hold roundish objects in the proper right hand, one with a tri-lobed decoration on its front; the upper right hands of the other two are missing. The seated bodhisattvas on the right wall have, from the front: #1 a spray of (lotus?) flowers, #2 a book on a flower #3 (missing), #4 a stemmed device, oval shaped, composed of jewels, perhaps backing a now broken flower. Above, on each side, there are small Buddhas in the meditation pose.', 'c12/c12_S1-9b.jpg', '', '', 1, 0, NULL, 65, 631, 0.13541667, 0.96630934, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
