VALUES (4101, 4101, 12, 12, 'rock-cut', 'Seated Buddha - main shrine - First floor', '', 'The main shrine on the first floor has a huge teaching Buddha seated in the dhyanasana. His throne motifs are equally huge, but simplified, with large hooded nagas directly behind the throne, with single flying celestials with garlands above on either side. He is surrounded with seated rather than standing bodhisattvas. Eight in number, and differentiated by their varied attributes, they may well represent an astabodhisattva (8-bodhisattva) mandala.', 'c12/c12_S1mainI-9.jpg', '', '', 1, 0, NULL, NULL, NULL, NULL, NULL, 'Arno Klein', 0, FALSE, NULL, FALSE)
