INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (4102, 4102, 12, 12, 'rock-cut', 'Lotus medallion - middle floor (between First and second floors)', '', 'Near the top of the staircase leading to the second floor, one can enter a large pillared chamber fronted by two pillars and that has a beautifully carved lotus medallion.', 'c12/c12_S2-21.jpg', '', '', 1, 0, NULL, NULL, NULL, NULL, NULL, 'Arno Klein', 0, FALSE, NULL, FALSE)
