VALUES (4112, 4112, 12, 12, 'rock-cut', 'istern chamber', '', 'The shorter left (north) stairway in the courtyard, near what appears to have been an original drainage tunnel leads past one of the various Buddha panels placed throughout the cave to a  square chamber with a still-functioning cistern near the center.  It is fronted by a very plain colonnade, and has four similar pilasters on each of the three walls.', 'c12/DSCN4914.jpg', '', '', 1, 0, NULL, 167, 458, 0.34791667, 0.70137825, 'Arno Klein', 0, FALSE, NULL, FALSE)
