VALUES (4191, 4191, 3, 3, 'rock-cut', 'Facade with window', 'Facade', 'Facade view of Cave 3 and also in view are caves 4 through 6. Cave 3 once had a deep porch leading into the interior through a central doorway, and fronted by a two pillared colonnade.  An impressively wide monolithic staircase must have once had steps leading to the basin of the seasonal waterfall.  This area in front shows remnants of a fine heavy molded basement, of a type commonly found in both Vakataka and Early Kalacuri prototypes.\r\nOutside the cave, at the left of the broken porch, there is an unusual pillared window; it is purely a recent cement reconstruction and totally inauthentic, except for the carved floral borders at the left.', 'c3_F1.jpg', '', '', 0, 0, NULL, 243, 446, 0.50625000, 0.92916667, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
