VALUES (4205, 4205, 3, 3, 'rock-cut', '', '', 'Outside the cave, at the left of the broken porch, there is an unusual pillared window; it is purely a recent cement reconstruction and totally inauthentic, except for the carved floral borders at the left (shown in this image).', 'c3/c3window.jpg', '', '', 1, 0, NULL, 187, 413, 0.38958333, 0.76481481, 'Arno Klein', 0, FALSE, NULL, FALSE)
