VALUES (4207, 4207, 4, 4, 'rock-cut', 'Avalokitesvara', 'Avalokitesvara', 'This is the finest panel in th cave which is at the left of the vestibule, showing Avalokitesvara seated in the bhadrasana pose with a long-stemmed lotus, antelope skin, and the Buddha Amitabha in his jata headdress.  He is attended by two female bodhisattvas - Tara, with her water jar, rosary, and ascetic''s headdress, and Bhrikuti with a beautiful bunch of lotuses and her more elegant coiffure.  Buddhas, one standing and one seated, occupy the upper corners of the large panel.', 'c4/c4_1.jpg', '', '', 1, 0, NULL, 127, 136, 0.26458333, 0.22149837, 'Arno Klein', 0, FALSE, NULL, FALSE)
