INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (4209, 4209, 4, 4, 'rock-cut', 'Buddha in the main shrine', 'Buddha', 'The large shrine Buddha, seated beneath an elaborate tree with unusual (for Ellora) cauri bearing bodhisattvas directly behind the conventionally decorated throne. Larger bodhisattvas stand in the expected positions on either side; the intact right figure has a stupa in his crown, and a small nagakesara flower in his upraised hand.  The left bodhisattva is too obliterated. Conventional flying couples converge from above upon the throne, with its conventional array of makaras (from each of which a vigorous figure emerges), vyalas, and elephants.', 'c4/c4_3.jpg', '', '', 2, 0, NULL, NULL, NULL, NULL, NULL, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
