VALUES (4210, 4210, 4, 4, 'rock-cut', 'Main shrine with Buddha image', 'Seated Buddha in main shrine', 'The large shrine Buddha, seated beneath an elaborate tree with unusual (for Ellora) cauri bearing bodhisattvas directly behind the conventionally decorated throne. Larger bodhisattvas stand in the expected positions on either side; the intact right figure has a stupa in his crown, and a small nagakesara flower in his upraised hand.  The left bodhisattva is too obliterated. Conventional flying couples converge from above upon the throne, with its conventional array of makaras (from each of which a vigorous figure emerges), vyalas, and elephants.', 'c4/c4_3a.jpg', '', '', 1, 0, NULL, 246, 29, 0.51250000, 0.04723127, 'Arno Klein', 0, FALSE, NULL, FALSE)
