INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (4213, 4213, 4, 4, 'rock-cut', 'Seated Buddha in bhadrasana - the Litany scene', 'Seated Buddha', 'The actual focus of this forward-facing shrinelet is the bhadrasana Buddha on its rear wall (seen in this image).  The expected bodhisattvas--Avalokitesvara with jata mukuta at the left and a crowned Vajrapani (?) leaning upon a burly dwarf at the right--attend the lion throne with its elaborate (and conventional) back, while siddhis (with ascetic headdresses) and dwarfs fly above.', 'c4/c4_A.jpg', '', '', 1, 0, NULL, 424, 286, 0.88333333, 0.46579805, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (4214, 4214, 4, 4, 'rock-cut', 'Standing Tara and Buddha', 'Tara and Buddha', 'The actual focus of this forward-facing shrinelet was the bhadrasana Buddha on its rear wall. To the right of this central panel is a large standing Tara, with the jata headdress, holding a large stemmed lotus and with her proper right hand in the gesture of reassurance (abhaya mudra), stands in a large panel in the right wall, with an equally large standing Buddha at her proper left.  Two smaller panels, the upper with an Avalokitesvara, the lower with a Tara, appear to have been added at the right, beyond which the wall has been repaired with cement.', 'c4/c4_B.jpg', '', '', 1, 0, NULL, 439, 312, 0.91458333, 0.50814332, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (4215, 4215, 4, 4, 'rock-cut', 'Avalokitesvara', 'Avalokitesvara', 'It appears that the intrusive adjacent passage, which carefully avoids cutting into Avalokitesvara''s lotus, was cut for convenient access via Cave 4''s abandoned right wall before the Litany was finished. Only the upper two episodes are now legible--forest fire at the top, and attack by a brigand just below.  We can assume that the bottom right panel was a shipwreck scene, always placed at the lower level.', 'c4/c4_C.jpg', '', '', 1, 0, NULL, 399, 311, 0.83125000, 0.50651466, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (4216, 4216, 4, 4, 'rock-cut', 'Avalokitesvara and Tara', 'Avalokitesvara and Tara', 'It appears that the intrusive adjacent passage, which carefully avoids cutting into Avalokitesvara''s lotus, was cut for convenient access via Cave 4''s abandoned right wall before the Litany was finished.\r\nThe right side of the Litany was appropriated by a fine Tara image, which is clearly somewhat later than the main Buddha panel, since the lotus is cut from the latter''s background matrix.  Although mere traces remains of the head of the soaring small Avalokitesvara and the supplicants father to the right (partly cut away by the smoothing around Tara''s halo, below her feet a badly eroded motif may represent one of Avalokitesvara''s supplicants being attacked by a lion.', 'c4/c4_C2.jpg', '', '', 1, 0, NULL, 408, 311, 0.85000000, 0.50651466, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (4217, 4217, 4, 4, 'rock-cut', 'General view', 'Main shrine at the rear', 'The surprising disjunction between the fine work being done in the very rear of Cave 4, the apparent abandonment of work on the later pillars and aisles, and the total loss of the whole cave front (including the total loss of the front aisle pillars) suggests that the front of Cave 4 may well have collapsed at this time. (Even the leveling of the ceiling was abandoned--only the first two or three feet in front of the rear colonnade being completed.', 'c4/c4_F.jpg', '', '', 1, 0, NULL, 209, 255, 0.43541667, 0.41530945, 'Arno Klein', 10, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
