VALUES (4218, 4218, 4, 4, 'rock-cut', 'Genral view', 'Main shrine at the rear', 'The surprising disjunction between the fine work being done in the very rear of Cave 4, the apparent abandonment of work on the later pillars and aisles, and the total loss of the whole cave front (including the total loss of the front aisle pillars) suggests that the front of Cave 4 may well have collapsed at this time. (Even the leveling of the ceiling was abandoned--only the first two or three feet in front of the rear colonnade being completed.', 'c4/c4_F1.jpg', '', '', 1, 0, NULL, 358, 213, 0.74583333, 0.34690554, 'Arno Klein', 0, FALSE, NULL, FALSE)
