VALUES (4220, 4220, 4, 4, 'rock-cut', 'Shrine with incomplete hall', 'Shrine with incomplete hall', 'The shrine is fronted with two fine albeit simple and severe purnaghata-capitaled pillars and matching pilasters.  The square bases of all of the pillars and pilasters (both much reconstructed with cement) are partially decorated with fine half-medallions but work broke off before they were completed.', 'c4/c4_H1.jpg', '', '', 1, 0, NULL, 338, 233, 0.70416667, 0.37947883, 'Arno Klein', 0, FALSE, NULL, FALSE)
