VALUES (4229, 4229, 5, 5, 'rock-cut', 'Bodhisattva at the main shrine entrance', 'Bodhisattva', 'Two bodhisattvas that flank the shrine entrance stand stiffly in their arched niches between haloed female attendants on either side.  Avalokitesvara (seen in this image) has the expected jata headdress, with a seated Buddha at its front, along with rosary, long-stemmed lotus, and an antelope skin.', 'c5/c5_2.jpg', '', '', 1, 0, NULL, 162, 80, 0.33750000, 0.11142061, 'Arno Klein', 0, FALSE, NULL, FALSE)
