VALUES (4230, 4230, 5, 5, 'rock-cut', 'Bodhisattva at the main shrine entrance', 'Bodhisattva', 'Two bodhisattvas that flank the shrine entrance stand stiffly in their arched niches between haloed female attendants on either side.  Avalokitesvara at the left has the expected jata headdress, with a seated Buddha at its front, along with rosary, long-stemmed lotus, and an antelope skin. The right bodhisattva (seen here) has a stupa in his crown, and holds the nagakesara flower.', 'c5/c5_3.jpg', '', '', 1, 0, NULL, 237, 78, 0.49375000, 0.10863510, 'Arno Klein', 0, FALSE, NULL, FALSE)
