VALUES (4231, 4231, 5, 5, 'rock-cut', 'Buddha - main shrine', 'Seated Buddha', 'The main image in the central shrine at the rear of the cave is attended by the bodhisattvas Avalokitesvara, characteristically at the left, with his jata headdress (but containing a stupa, not a Buddha image), antelope skin, and lotus.  The other figure, (presumably) Maitreya, is crowned, again with a stupa carved at its front.  The throne is elaborate, with birds'' heads and rich scrolls emerging from the roiling makaras at the top.  Large flying figures fill the space overhead.', 'c5/c5_4.jpg', '', '', 1, 0, NULL, 200, 30, 0.41666667, 0.04178273, 'Arno Klein', 0, FALSE, NULL, FALSE)
