VALUES (4240, 4240, 5, 5, 'rock-cut', 'Main prayer hall', 'main prayer hall', 'Cave 5 is particularly interesting because of its unusual plan and size-it is over thirty-five meters from front to back. Like its earlier counterparts at Kanheri and Bagh, it has long parallel carved benches running down its center, almost certainly for the kind of ritual recitations that still take place in similarly planned Himalayan monasteries today. Indeed, the parallel beams under the pillars are equally high, probably since they could have served for seating as well.', 'c5/c5_H.jpg', '', '', 1, 0, NULL, 204, 85, 0.42500000, 0.11838440, 'Arno Klein', 0, FALSE, NULL, FALSE)
