VALUES (4269, 4269, 5, 5, 'rock-cut', 'Bodhisattva at the main shrine entrance', 'Bodhisattva at the main shrine entrance', 'Two bodhisattvas that flank the shrine entrance stand stiffly in their arched niches between haloed female attendants on either side.  Avalokitesvara at the left (seen here) has the expected jata headdress, with a seated Buddha at its front, along with rosary, long-stemmed lotus, and an antelope skin. The right bodhisattva  has a stupa in his crown, and holds the nagakesara flower.', 'c5/c5SDl.jpg', '', '', 1, 0, NULL, 162, 80, 0.33750000, 0.11142061, 'Arno Klein', 0, FALSE, NULL, FALSE)
