INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (4300, 4300, 6, 6, 'rock-cut', 'Central shrine flanked by Avalokitesvara and Vajrapani', 'pillars in front of the main shrine', 'The pillars and pilasters in this central shrine show fine purnaghata capitals, with dwarfs sitting on the tops of the bases and animal riders on the extensions of the capitals above.  \r\nThe familiar bodhisattva Avalokitesvara stands in his accustomed position, flanking the shrine doorway at the left, and holding a particularly elaborate stemmed lotus. He has the rosary, antelope skin, and Amitabha Buddha image in his jata headdress.  Male and female attendants stand beside him, the females carefully turned toward the shrine, and dwarfs converge upon him from beneath the luxuriant foliate motifs and festoons above.  The other bodhisattva, with a stupa in his crown, may be identified as Vajrapani since his attendant wears a vajra (thunderbolt) in his headdress.', 'c6/c6_Se.jpg', '', '', 1, 0, NULL, 279, 129, 0.58125000, 0.39570552, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
