VALUES (4301, 4301, 6, 6, 'rock-cut', 'Mandala (left of main seated Buddha)', 'Mandala', 'The shrine is particularly interesting since besides the expected bhadrasana Buddha on his conventional but elaborate lion-throne, and the expected attendant bodhisattvas there are mandalas (as seen here). Each mandala is composed of nine seated Buddhas, on the left and right shrine walls. The Buddhas all sit against simplified thrones, decorated with vyalas and makaras.', 'c6/c6_SI.jpg', '', '', 1, 0, NULL, 235, 67, 0.48958333, 0.20552147, 'Arno Klein', 0, FALSE, NULL, FALSE)
