VALUES (4330, 4330, 7, 7, 'rock-cut', 'Central hall with monk cells', 'monk cells', 'Cave 7, a large cave "supported" by only four simple square pillars of a very "reduced" design. Neither the twelve cells nor the shrine, defined only by a slightly more complex doorway, were ever finished.', 'c7/c7HbrW.jpg', '12/2003', '', 1, 0, NULL, 299, 172, 0.62291667, 0.36830835, 'Arno Klein', 0, FALSE, NULL, FALSE)
