VALUES (4331, 4331, 7, 7, 'rock-cut', 'Central hall with monk cells', 'monk cells', 'One of the doors of the monk cell leads to the adjacent cave (seen here with a wire mesh screen door. It seems that cave 7 was contemporaneous with the adjacent Cave 8, where the cells at the right were apparently omitted because of Cave 7''s proximity and priority. A passage in this same wall, perhaps an aborted cell, connects the two excavations, apparently incorporating Cave 7''s unfinished Cell.', 'c7/c7HlW.jpg', '12/2003', '', 1, 0, NULL, 141, 314, 0.29375000, 0.67237687, 'Arno Klein', 0, FALSE, NULL, FALSE)
