VALUES (4351, 4351, 8, 8, 'rock-cut', 'Avalokitesvara and Tara', 'Avalokitesvara and Tara', 'A fine representation of Avalokitesvara, with his long-stemmed lotus and water-pot, Amitabha in his jata headdress and antelope skin appears at the rear of the left wall of the seated Buddha image in Cave 8A, while toward the front on the same wall a goddess with a large headdress - possibly Tara stands holding a bunch of flowers and leaves (possibly a bouquet of blue lotuses.', 'c8/c8_I2-3.jpg', '', '', 2, 0, NULL, NULL, NULL, NULL, NULL, 'Arno Klein', 0, FALSE, NULL, FALSE)
