VALUES (4352, 4352, 8, 8, 'rock-cut', 'main shrine doorway', '', '', 'c8/c8_SD.jpg', '', '', 1, 0, NULL, 262, 225, 0.54583333, 0.35211268, 'Arno Klein', 0, FALSE, NULL, FALSE)
