INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (4353, 4353, 8, 8, 'rock-cut', 'Bodhisattva', 'Bodhisattva', 'Inside the main shrine, the Buddha (with only one converging celestial) on each side overhead) is flanked by two standing bodhisattvas. However, the figure of Avalokitesvara (seen here) on the left is remarkable since it has four arms, perhaps the first attendant to be so shown in any Buddhist vihara.  The hand with the rosary almost touches the hand of a large goddess farther forward on the crowded wall. Between them a male and a female figure kneel, offering flowers. The male has what looks like an usnisa! (Perhaps a misunderstanding on the part of the artist?) \r\n\r\nThe standing female figure''s significance is suggested not only by the fact that two dwarfs converge above her but also by her beautiful headdress and the bunch of flowers that she holds.', 'c8/c8_SIl.jpg', '', '', 2, 0, NULL, NULL, NULL, NULL, NULL, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
