VALUES (4369, 4369, 8, 8, 'rock-cut', 'Main shrine - Buddha', 'Buddha and bodhisattvas', 'The usual standing and attended bodhisattvas on either side of the shrine doorway-Avalokitesvara has his rosary, jata headdress with Amitabha Buddha, antelope skin and lotus, while the other bodhisattva has a stupa in his crown.', 'c8/c8SD.jpg', '12/2003', '', 1, 0, NULL, 262, 224, 0.54583333, 0.35054773, 'Arno Klein', 0, FALSE, NULL, FALSE)
