INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (4370, 4370, 8, 8, 'rock-cut', 'Buddha and bodhisattvas', 'Buddha', 'Inside the crowded shrine, the Buddha (with only one converging celestial) on each side overhead) is flanked, as expected, by two standing bodhisattvas, with the same expected attributes.', 'c8/c8SI.jpg', '12/2003', '', 1, 0, NULL, 264, 167, 0.55000000, 0.26134585, 'Arno Klein', 0, FALSE, NULL, FALSE)
