INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (4371, 4371, 8, 8, 'rock-cut', 'Standing female figure', 'Female figure with flowers', 'Inside the main shrine, the Buddha (with only one converging celestial) on each side overhead) is flanked by two standing bodhisattvas. However, the figure of Avalokitesvara (seen here) on the left is remarkable since it has four arms, perhaps the first attendant to be so shown in any Buddhist vihara.  The hand with the rosary almost touches the hand of a large goddess farther forward on the crowded wall. Between them a male and a female figure kneel, offering flowers. The male has what looks like an usnisha (Perhaps a misunderstanding on the part of the artist?) \r\nThe standing female figure''s significance is suggested not only by the fact that two dwarfs converge above her but also by her beautiful headdress and the bunch of flowers that she holds.', 'c8/c8SlWI1.jpg', '12/2003', '', 2, 0, NULL, NULL, NULL, NULL, NULL, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (4372, 4372, 8, 8, 'rock-cut', 'Bodhisattva and standing female figure', 'Bodhisattva and standing female figure', 'Inside the main shrine, the Buddha (with only one converging celestial) on each side overhead) is flanked by two standing bodhisattvas. However, the figure of Avalokitesvara (seen here) on the left is remarkable since it has four arms, perhaps the first attendant to be so shown in any Buddhist vihara.  The hand with the rosary almost touches the hand of a large goddess farther forward on the crowded wall. Between them a male and a female figure kneel, offering flowers. The male has what looks like an usnisa! (Perhaps a misunderstanding on the part of the artist?) \r\n\r\nThe standing female figure''s significance is suggested not only by the fact that two dwarfs converge above her but also by her beautiful headdress and the bunch of flowers that she holds.', 'c8/c8SlWI2.jpg', '12/2003', '', 2, 0, NULL, NULL, NULL, NULL, NULL, 'Arno Klein', 0, FALSE, NULL, FALSE)
