VALUES (4376, 4376, 9, 9, 'rock-cut', 'Caves 8 and 9 facade', 'Facade', 'View of Caves 8 and 9 with elaborate facade of cave 9.', 'c9/c9_F3.jpg', '', '', 1, 0, NULL, 221, 178, 0.46041667, 0.60544218, 'Arno Klein', 0, FALSE, NULL, FALSE)
