INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (4377, 4377, 9, 9, 'rock-cut', 'Facade', 'Facade', 'Cave 9''s elaborate upper facade levels contain a series of six seated Buddhas in ornate arches, in a sequence of three, two, and one, reading from bottom to top. Playful dwarfs and supporting yakshas appear between the arches, while bhadrasana Buddhas, probably the ""Seven Historical Buddhas", alternate with standing bodhisattvas, in the frieze below.', 'c9/c9_F4.jpg', '', '', 1, 0, NULL, 237, 136, 0.49375000, 0.46258503, 'Arno Klein', 10, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (4378, 4378, 9, 9, 'rock-cut', 'Pillar detail', 'Pillar', 'The pillars fronting this shrine area, with their simple but effective scroll forms at the top, show the "unfinished medallion" motif found in Cave 10 and in the somewhat later Caves 11 and 12. Loving couples are carved in the eight central panels of the right pillar but not on all of those at the left, suggests that the decoration of the pillars and pilasters was still in process when work stopped.', 'c9/c9_pd2.jpg', '', '', 1, 0, NULL, 266, 105, 0.55416667, 0.35714286, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (4379, 4379, 9, 9, 'rock-cut', 'Seated Buddha', 'Buddha', 'In the triad of niches within the cave, where many traces of paint remain, the central bhadrasana Buddha (seen here) with flying siddhis above sits upon a conventional lions throne.  Avalokitesvara is placed in the niche at the left, with dwarfs above, and two female attendants; with Buddha in his jata headdress, a rosary in his broken proper right hand, the long-stemmed lotus, and the antelope skin.  The right bodhisattva, similarly attended, has a stupa in his crown.', 'c9/c9_SI1.jpg', '', '', 1, 0, NULL, 232, 42, 0.48333333, 0.14285714, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
