VALUES (4391, 4391, 14, 14, 'rock-cut', 'Andhakasuravadha', '', 'With the skin of the elephant demon held behind him, Siva as Bhairava has pierced the demon Andhaka straight through, catching his dangerous blood in a skull cup. At the upper left, the impaled demon is already praising Siva for his painful but saving release, while Parvati and her (damaged) lion are seated below. Ganesa, visible between Siva''s legs, is apparently dancing to the beat of the drumming dwarf at the left.', 'c14/c14-10.jpg', '', '', 1, 0, NULL, 126, 641, 0.26250000, 0.96390977, 'Arno Klein', 0, FALSE, NULL, FALSE)
