VALUES (4399, 4399, 14, 14, 'rock-cut', 'Siva and Parvati playing chausar', '', 'Siva and Parvati are playing chausar in their rocky abode on Mount Kailasa, while the elephant-headed Ganesa and other attendants observe them. Siva (with one of his four hands) grabs Parvati''s hand in the course of their sometimes acrimonious game, while the ganas torment the long-suffering bull Nandi below.\r\n', 'c14/c14-13d.jpg', '', '', 1, 0, NULL, 188, 643, 0.39166667, 0.96691729, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (4400, 4400, 14, 14, 'rock-cut', 'Durga (right wall)', '', 'The emphasis on feminine focus is amplified in this cave by the large images of Durga at either end of the front aisle. Durga rests her foot upon her lion, and holds her trident at the ready in the left end relief, while in the right, with the help of the furious beast, she prepares to slay the demonic buffalo.  Indeed, there is every reason to believe that the cave was originally dedicated to Durga herself, since the socket of the pitha in the shrine was not shaped to receive a lingam; it seems certain that it must once have held the fine broken image of the goddess, now missing. Also of particular significance is the small panel showing Durga--which appears as part of an unfinished frieze composed largely of active dwarfs--slaying the buffalo at the center of the beam directly above the two rear central hall pillars; such a positioning--like that of Lakulisa in Caves 19 and 21--clearly connects the cave with the image shown, and it is scarcely an accident that both the broken image once in the shrine and the crucially placed image at the rear of the hall show the actual defeat of the demon, thus completing the "narrative" sequence started in the front aisle.  One can further note another small figure at the very center of the similar frieze on the beam above the pillar on the right side of the hall.  Although hard to see, this is surely another Durga, flanked by a similar series of empaneled dwarfs and flowers. It can be safely assumed that, had the whole been completed, there would have been another Durga image at the left too.', 'c14/c14-14.jpg', '', '', 1, 0, NULL, 195, 646, 0.40625000, 0.97142857, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
