VALUES (4410, 4410, 14, 14, 'rock-cut', 'Andhakasuravadha', '', 'With the skin of the elephant demon held behind him, Siva as Bhairava has pierced the demon Andhaka straight through, catching his dangerous blood in a skull cup. At the upper left, the impaled demon is already praising Siva for his painful but saving release, while Parvati and her (damaged) lion are seated below. Ganesa, visible between Siva''s legs, is apparently dancing to the beat of the drumming dwarf at the left.', 'c14/c14andhakasura.jpg', '', '', 1, 0, NULL, 149, 642, 0.31041667, 0.96541353, 'Arno Klein', 0, FALSE, NULL, FALSE)
