VALUES (4411, 4411, 14, 14, 'rock-cut', 'Facade', '', 'Splendidly decorated Cave 14 is a Hindu dedication that reflects the increasing focus on feminine divinities. This cave is also popularly called the Ravana ka khai (Ashes of Ravana).\r\nThe pillars of the front colonnade, except for that at the extreme left are poor cement reconstructions. The pilaster at the left with its fine female bracket, clearly derived from the type in Caves 21 and 17, is intact. Its counterpart at the right is broken beyond recognition.', 'c14/c14F.jpg', '', '', 1, 0, NULL, 297, 591, 0.61875000, 0.88872180, 'Arno Klein', 0, FALSE, NULL, FALSE)
