VALUES (4429, 4429, 14, 14, 'rock-cut', 'Pitha', '', 'There is every reason to believe that the cave was originally dedicated to Durga herself by the number of sculptures that represent Durga placed in the most significant areas of the cave. This is further attensted by the pitha in the main shrine since the socket of the pitha was not shaped to receive a lingam (as some publication declare); it seems certain that it must once have held the fine broken image of the goddess.', 'c14/c14lingapitha.jpg', '', '', 1, 0, NULL, 237, 113, 0.49375000, 0.16992481, 'Arno Klein', 0, FALSE, NULL, FALSE)
