VALUES (4436, 4436, 14, 14, 'rock-cut', 'Dancing Siva - Nataraj details', '', 'Siva, wreathed with serpents, is dancing to the beat of the great drum and the sounds of the wooden flute at the left, while Parvati and the emaciated Bhringi (seen dramatically poised behind his lord) attend his raptures. In the clouds above are Agni on his ram, Indra on his elephant, Brahma on his goose (hamsa) and Vishnu on his sun-bird Garuda.', 'c14/c14nataraja.jpg', '', '', 1, 0, NULL, 169, 642, 0.35208333, 0.96541353, 'Arno Klein', 0, FALSE, NULL, FALSE)
