VALUES (4445, 4445, 14, 14, 'rock-cut', 'Main hall', '', 'The rear central capitals, before the shrine, are the most fully decorated; even their kirttimukhas are multiplied.  They are ringed by sixteen exuberantly varied zoomorphic panels and have 48 diagonal striations.', 'c14/c14S.jpg', '', '', 1, 0, NULL, 205, 638, 0.42708333, 0.95939850, 'Arno Klein', 0, FALSE, NULL, FALSE)
