VALUES (4446, 4446, 14, 14, 'rock-cut', 'Saptamatrika', '', 'The Seven Mothers, attended by Virabhadra at the left and Ganesa, the skeletal Kala (Time) and with the deadly goddess Kali at his right, appear at the far (right) end of the ambulatory passage.  This group of mother goddesses is better preserved than its counterpart in Cave 21, from which its style and iconographic features clearly derive. Each of the figure is easily identifiable by its vahana, for example, Brahmi with her goose or hamsa, Mahesvari with her bull, Kumari with her peacock, Vaisnavi with the sunbird Garuda, Varahi with her boar, Indrani with her elephant, and Saraswati with her owl.  All have their children, either seated on their laps or trying to climb up onto them.', 'c14/c14Saptamatrika1.jpg', '', '', 1, 0, NULL, 74, 643, 0.15416667, 0.96691729, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
