VALUES (4458, 4458, 14, 14, 'rock-cut', 'Main shrine doorway', 'Female figures', 'Life-size females, with their own female attendants (two on the left), directly flank the shrine doorway, assuming something of both the position and function of the huge dvarapalas nearby. There are also two carved female figures (again with their own female attendants) at the bottom of the otherwise plain shrine doorway, these further emphasize the feminine focus of this cave.', 'c14/c14Sentranced1.jpg', '', '', 1, 0, NULL, 236, 200, 0.49166667, 0.30075188, 'Arno Klein', 0, FALSE, NULL, FALSE)
