VALUES (4459, 4459, 14, 14, 'rock-cut', 'Siva and Parvati playing chausar', '', 'Siva and Parvati are playing chausar in their rocky abode on Mount Kailasa, while the elephant-headed Ganesa and other attendants observe them. Siva (with one of his four hands) grabs Parvati''s hand in the course of their sometimes acrimonious game, while the ganas torment the long-suffering bull Nandi below.\r\n', 'c14/c14sivaparvatiplayingchaupat.jpg', '', '', 1, 0, NULL, 183, 644, 0.38125000, 0.96842105, 'Arno Klein', 0, FALSE, NULL, FALSE)
