VALUES (4480, 4480, 15, 215, 'rock-cut', 'Siva Dancing (Siva Nataraja)', '', 'The second panel along the left wall shows Siva furiously dancing (Siva Nataraja), energizing the seemingly universal space within which he is contained with the powerful action of his massive form and his many arms.  His drummer, with three large drums, sits at the left, while flutists and other percussionists appear at the right.  Celestials (including bird-legged kinnaras) soar above.)', 'c15/c15-17.jpg', '', '', 1, 0, NULL, NULL, NULL, NULL, NULL, 'Arno Klein', 0, FALSE, NULL, FALSE)
