VALUES (4486, 4486, 15, 215, 'rock-cut', 'Siva emerging from the lingam', '', 'Siva springs forth from the lingam to save his young devotee Markandeya from Yama, the god of death, seen at the right with his noose.', 'c15/c15-22.jpg', '', '', 1, 1, NULL, 149, 120, 0.31041667, 0.23210832, 'Arno Klein', 0, FALSE, NULL, FALSE)
