VALUES (4487, 4487, 15, 215, 'rock-cut', 'The Descent of the Ganges through Siva''s hair', '', 'To release the waters from the heavens for the benefit of the earth, Siva offers to break the Ganges'' fall by receiving her full force in his matted locks.  At the left of his ascetic''s headdress, the twisting river can be seen in the course of its descent.  A jealous Parvati stands at Siva''s side, while the ascetic Bhagiratha, whose austerities convinced Siva to take on this task, continues his productive penance--his hands over his head--at the lower left.', 'c15/c15-23.jpg', '', '', 1, 0, NULL, NULL, NULL, NULL, NULL, 'Arno Klein', 0, FALSE, NULL, FALSE)
