VALUES (4493, 1064, 15, 215, 'rock-cut', 'Lingodbhavamurti', '', 'Siva emerging from the lingam. (Lingodbhavamurti) Challenged to find the extremities of Shiva''s limitless lingam, Brahma (as a hamsa or swan) flies upward, while Vishnu (as a rooting boar) snouts downward; but neither (seen also standing at either side with their characteristic attributes) is able to discover its extremities, and thus offer him their praise.', 'c15/c15-29.jpg', '', '', 1, 0, NULL, 7, 454, 0.01458333, 0.87814313, 'Arno Klein', 0, FALSE, NULL, FALSE)
