VALUES (4507, 4507, 15, 215, 'rock-cut', 'Tripurantaka', '', 'Riding in a chariot driven by Brahma, Siva destroys the three palace-cities of the demons, which could be penetrated only by a single arrow.', 'c15/c15-30.jpg', '', '', 1, 0, NULL, NULL, NULL, NULL, NULL, 'Arno Klein', 0, FALSE, NULL, FALSE)
