VALUES (4510, 1000, 15, 215, 'rock-cut', 'Vishnu on his Sun-bird, Garuda, rescuing the elephant - Gajendramoksha', '', 'The elephant king, Gajendra, (at the lower right) was caught by a crocodile, but was saved when he prayed to Vishnu for salvation.  The god, on his mount, descends for the rescue.\r\n\r\n', 'c15/c15-33.jpg', '', '', 1, 0, NULL, 17, 436, 0.03541667, 0.84332689, 'Arno Klein', 0, FALSE, NULL, FALSE)
