VALUES (4515, 995, 15, 215, 'rock-cut', 'Vishnu takes three great strides (Trivikrama)', '', 'Vishnu in his fifth incarnation as the dwarf (Vamana) wins back the universe for the gods by encompassing it with three vast strides.\r\n\r\n', 'c15/c15-36.jpg', '', '', 1, 0, NULL, 18, 482, 0.03750000, 0.93230174, 'Arno Klein', 0, FALSE, NULL, FALSE)
