VALUES (4516, 4516, 15, 215, 'rock-cut', 'Vishnu as half-man half-lion (Narasimha) destroys Hiranyakasipu', '', 'The demon Hiranyakasipu had, through his austerities, obtained a boon from the gods, pledging that he could not be destroyed either indoors or outdoors, by night or by day, or by man or beast.  But Vishnu, in a half-lion half-human form (neither man nor beast), kills him at dusk (neither day nor night) on a verandah (neither inside nor outside. At the left Garuda battles the demon king Bali.\r\n\r\n', 'c15/c15-37.jpg', '', '', 1, 0, NULL, NULL, NULL, NULL, NULL, 'Arno Klein', 0, FALSE, NULL, FALSE)
