VALUES (4522, 4522, 15, 215, '', '', '', 'The second panel along the left wall shows Siva furiously dancing (Siva Nataraja), energizing the seemingly universal space within which he is contained with the powerful action of his massive form and his many arms.  His drummer, with three large drums, sits at the left, while flutists and other percussionists appear at the right.  Celestials (including bird-legged kinnaras) soar above.)\r\n', 'c15/c15-d17.jpg', '', '', 1, 0, NULL, 139, 305, 0.28958333, 0.58994197, 'Arno Klein', 0, FALSE, NULL, FALSE)
