VALUES (4528, 4528, 15, 215, 'rock-cut', 'Marriage of Siva and Parvati', '', 'Marriage of Siva and Parvati; Brahma (three heads showing), below, squats to attend the marriage fire, while various gods on their vehicles fly above. The placement of Parvati on Siva''s proper left--her normal position only after the marriage--is unusual.', 'c15/c15-d20a.jpg', '', '', 1, 0, NULL, NULL, NULL, NULL, NULL, 'Arno Klein', 0, FALSE, NULL, FALSE)
