VALUES (4530, 4530, 15, 215, 'rock-cut', 'Vishnu reclining on the endless serpent, Sesha', '', 'Vishnu, containing the universe, lies dormant on the waters represented by the serpent, while his consort, Laksmi, representing the vegetative energy, disturbs his sleep, to start the process of creation; the first manifestation is the god Brahma, who appears above on a lotus that sprouts upward from Vishnu''s navel.  His four attributes are personified below, along with two demons, shown as dwarfs at the lower right. \r\n\r\n', 'c15/c15-d32.jpg', '', '', 1, 0, NULL, 421, 195, 0.87708333, 0.37717602, 'Arno Klein', 0, FALSE, NULL, FALSE)
