VALUES (4561, 939, 15, 15, 'rock-cut', 'Smaller shrine on the left of main court', 'Dwarapalas', 'To the left of the court''s lowest level, there is a damaged shrine with a polished lingam in a late-type circular pitha, the shrine doorway being guarded by Saiva dvarapalas with characteristic clubs and assertive poses.', 'c15/c15_S1-3-6.jpg', '', '', 1, 0, NULL, 25, 533, 0.05208333, 0.84202212, 'Arno Klein', 0, FALSE, NULL, FALSE)
