VALUES (4562, 4562, 15, 15, 'rock-cut', 'Small shrine to the left of the main court', 'Lingam', 'To the left of the court''s lowest level, there is a damaged shrine with a polished lingam in a late-type circular pitha, the shrine doorway being guarded by Saiva dvarapalas with characteristic clubs and assertive poses.', 'c15/c15_S1-4-5.jpg', '', '', 1, 0, NULL, 157, 514, 0.32708333, 0.81200632, 'Arno Klein', 0, FALSE, NULL, FALSE)
