INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (4563, 936, 15, 15, 'rock-cut', 'Ganesa', '', 'To the left of the court''s lowest level, there is a damaged shrine with a polished lingam in a late-type circular pitha, the shrine doorway being guarded by Saiva dvarapalas with characteristic clubs and assertive poses.  On the left wall is a standing Parvati enduring the "five fires" (seen here); two (only) are shown below.  She has the ascetic''s headdress, rosary, and water jar.  Just to the right stand Vishnu with lotus and cakra above; the personified (female) mace (gada) stands below at the left, the personifed (male) conch at the right.  Next, to the right, stands Brahma, with three (of four) heads and with rosary and water pot,  holding lotuses in his upper hands; the scraggly birds below must be his hamsas. The other wall shows traces of a Ganesa, the head and trunk alone being vaguely visible.', 'c15/c15_S1-7.jpg', '', '', 1, 0, NULL, NULL, NULL, NULL, NULL, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
