INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (4584, 4587, 15, 15, 'rock-cut', 'Nandi mandapa (rear view)', '', 'Sometimes called a Dancing Hall, this monolithic structure may have been a shrine for the devoted bull Nandi. Despite its necessarily low placement, this shrine was associated with the lingam in the upper floor.  However, it had to be cut at its present low level because the earlier Buddhist excavators had already removed some or most of the matrix from the area above its roof. It is likely that the handsome loose image of Siva''s bull that sits on the floor of the upper pillared hall on axis with the lingam, was once placed upon the roof of this courtyard edifice, in order to allow it better to attend the lingam within the cave.  This would explain the anomalously flat treatment of the roof, with its low central platform, probably originally for the Nandi iself.', 'c15/c15_S2.jpg', '', '', 1, 0, NULL, 35, 513, 0.07291667, 0.81042654, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
