INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (4605, 4606, 15, 15, 'rock-cut', 'Facade Das Avatara cave', '', 'Cave 15, started toward the very end of late Buddhist phase of work at Ellora, was interrupted in mid-course by the Rastrakuta Dantidurga''s conquest of the region in about 750 A.D or (more probably) just before.  \r\nAlso called the Das Avatara--referring to the ten manifestation of Vishnu, a few of which are indeed shown in the cave, is in fact a Saiva dedication, attested by the presence of lingam shrine. However, its vast pillared plan, so akin to those of the late Buddhist Caves 11 and 12, to say nothing of its placement close to them (separated only by the earlier Caves 13 and 14) recommend the theory that it was in fact started as a late Buddhist vihara.  What seems to confirm this view is the presence of small images of seated Buddhas on the front pillar capitals of the upper floor, together with figures of seated female figures, presumably Taras, on the two pilaster capitals.  \r\n', 'c15/c15F.jpg', '12/2003', '', 1, 0, NULL, 25, 480, 0.05208333, 0.75829384, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
