VALUES (5219, 5219, 17, 17, 'rock-cut', 'Lingam', '', 'The shrine contains a monolithic pitha with a set-in lingam.  From such an Early Kalacuri cave as expected the pitha is square, while the lingam still has only two sections - square and round.', 'c17/c17_linga.jpg', '', '', 1, 0, NULL, 244, 114, 0.50833333, 0.19791667, 'Arno Klein', 0, FALSE, NULL, FALSE)
