VALUES (5220, 1953, 17, 17, 'rock-cut', 'Kubera - unfinished', '', 'The pillared chamber at the left of Cave 17''s court opens into a small underground cistern at its rear (east) end; it is likely that had time allowed the reservoir would have been greatly enlarged, like the similarly located ones in Caves 21 and 14. In the similar chamber on the opposite side of the court a single male figure with a crown has been barely started (seen here). Although it is hard to be certain, this may well be a representation of Kubera, who is so often honored at the site.', 'c17/c17_rW-kubera.jpg', '', '', 1, 0, NULL, 392, 397, 0.81666667, 0.68923611, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
