VALUES (5237, 5237, 17, 17, 'rock-cut', 'Main hall', '', 'The interior space is filled with eight huge pillars, disposed in two equally spaced groups of four on either side of a widened central space leading to the shrine. There is no shrine antechamber, although an ambulatory surrounds the shrine; and for the first time one both entered and left the ambulatory through carefully defined doorways.', 'c17/c17HP10.jpg', '', '', 1, 0, NULL, 176, 235, 0.36666667, 0.40798611, 'Arno Klein', 0, FALSE, NULL, FALSE)
