VALUES (5239, 5239, 17, 17, 'rock-cut', 'Female bracket figures', '', 'Emphasis on female figures in the cave is most obvious from the female brackets. These figures, with their attendants, both standing and flying, line the axis of the cave, while both the front and rear center pillars have equally beautiful brackets on their rear faces, the important rear pillars also having them on the front face.  Similar to Cave 21, these female bracket figures generally have an attendant female (sometimes a female dwarf) on one side and an old and/or crippled man with a cane on the other.\r\nThe emphasis on the feminine which has been emerging throughout the Early Kalacuri period extends to the elaborate decoration of the bases of the rear central pair of pillars. All four sides (where fully completed) have carvings of a beautiful female occupying the central panel, with attendant males on either side.', 'c17/c17HP2.jpg', '', '', 1, 0, NULL, 299, 226, 0.62291667, 0.39236111, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
