VALUES (5252, 5252, 17, 17, 'rock-cut', 'Ganesa', '', 'Broken-tusked sonof Siva, Ganesa, at sits on the left of the main mandapa with a cobra around his waist and holding his axe, a rosary, and a flower, while consuming laddus. Below Ganesa are music-making dwarfs, that at the right with a stringed instrument, while the other, painfully constricted, playing cymbals.', 'c17/c17HWlI_ganesa.jpg', '12/2003', '', 1, 0, NULL, 108, 309, 0.22500000, 0.53645833, 'Arno Klein', 0, FALSE, NULL, FALSE)
