VALUES (5258, 5258, 17, 17, 'rock-cut', 'Shrine doorway', '', 'The shrine doorway decoration announces a dependency on Cave 21, for it is clearly a somewhat less successful copy of that great portal''s rich design.  The decoration is only half-finished, and some of the details, such as the figures on the unfinished left jamb, are very fine; but the whole lintel carving reduces the vigor of Cave 21''s design and overcrowds the converging celestials above, so that much of the impact is lost.', 'c17/c17SD.jpg', '12/2003', '', 1, 0, NULL, 245, 150, 0.51041667, 0.26041667, 'Arno Klein', 0, FALSE, NULL, FALSE)
