INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (5267, 5267, 17, 17, 'rock-cut', 'Shrine doorway detail', '', 'The shrine doorway decoration announces a dependency on Cave 21, for it is clearly a somewhat less successful copy of that great portal''s rich design.  The decoration is only half-finished, and some of the details, such as the figures on the unfinished left jamb, are very fine; but the whole lintel carving reduces the vigor of Cave 21''s design and overcrowds the converging celestials above, so that much of the impact is lost.', 'c17/S17SD_detail4.jpg', '12/2003', '', 1, 0, NULL, 223, 159, 0.46458333, 0.27604167, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (5269, 5269, 18, 18, 'rock-cut', '', 'Lingam', 'Although an extremely plain cave, it has sufficient features to identify it as an eighth century Rastrakuta conception. This is particularly evident from the late circular form of the pitha in the shrine, and the octagonal section that since Early Kalacuri times has been added to the mid-section of the lingam.', 'c18/c18_lingam.jpg', '12/2003', '', 1, 0, NULL, 239, 51, 0.49791667, 0.07338129, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
INSERT INTO images (image_id, master_id, cave_id, plan_id, medium, subject, motifs, description, file_path, image_date, notes, rank, rotate, thumbnail, plan_x_px, plan_y_px, plan_x_norm, plan_y_norm, photographer, default_priority, assignment_questionable, assignment_notes, coordinates_questionable)
VALUES (5270, 5270, 18, 18, 'rock-cut', 'Facade', '', 'From the enclosed court with the Nandi shrine one approaches the hall via a short flight of steps bounded by massive (now ruinous) balustrades.  Within the wide porch, at the left and right, there are large platforms, raised and fronted by candrasilas.', 'c18/c18F.jpg', '12/2003', '', 1, 0, NULL, 237, 610, 0.49375000, 0.87769784, 'Arno Klein', 0, FALSE, NULL, FALSE)
ON CONFLICT (image_id) DO NOTHING;
