VALUES (5271, 5271, 18, 18, 'rock-cut', 'Main hall', '', 'The plan of the cave is simple and functional, with a four-pillared porch (or porch-like hall) leading to a two-pillared shrine antechamber and lingam shrine behind.', 'c18/c18SD.jpg', '12/2003', '', 1, 0, NULL, 240, 129, 0.50000000, 0.18561151, 'Arno Klein', 0, FALSE, NULL, FALSE)
