VALUES (5276, 1918, 19, 19, 'rock-cut', 'Lakulisa', '', 'Just as on the entablature of Cave 21, the Lakulisa image here forms the "centerpiece" between panels (here mostly incomplete) on either side. He holds the expected club (lakula) and has the urdhvalingam (erect phallus) often found in such depictions.  Probably because of space restraints, only two of his normally four disciples are shown, along with two flying figures above.', 'c19/c19H_lakulisa.jpg', '12/2003', '', 1, 0, NULL, 235, 282, 0.48958333, 0.41839763, 'Arno Klein', 0, FALSE, NULL, FALSE)
