VALUES (5279, 5279, 19, 19, 'rock-cut', 'Lingam', '', 'A massive square pitha (typical of the Kalachuri period) holds the large lingam and is composed of a square base with a rounded top.', 'c19/c19S_linga.jpg', '12/2003', '', 1, 0, NULL, 236, 129, 0.49166667, 0.19139466, 'Arno Klein', 0, FALSE, NULL, FALSE)
