VALUES (5280, 5281, 19, 19, 'rock-cut', 'Shrine doorway', '', 'The entrance to the shrine, as in Cave 20, was raised up very high, apparently to avoid a bad flaw which runs just below the top of the high but simple candrasila, from which steps rise to the shrine doorway. The latter is decorated with conventional floral bands like those in Cave 20, but somewhat less complex. All ultimately derive from Vakataka--and earlier--prototypes.', 'c19/c19SD.jpg', '12/2003', '', 1, 0, NULL, 237, 232, 0.49375000, 0.34421365, 'Arno Klein', 0, FALSE, NULL, FALSE)
